INSERT INTO `about_us_translations` VALUES (1,1,'ru','Apple Inc','Apple Inc','<p><strong>Apple Inc.</strong>&nbsp;is an American multinational&nbsp;<a title=\"Technology company\" href=\"https://en.wikipedia.org/wiki/Technology_company\">technology company</a>&nbsp;headquartered in&nbsp;<a title=\"Cupertino, California\" href=\"https://en.wikipedia.org/wiki/Cupertino,_California\">Cupertino, California</a>, in&nbsp;<a title=\"Silicon Valley\" href=\"https://en.wikipedia.org/wiki/Silicon_Valley\">Silicon Valley</a>, best known for its&nbsp;<a title=\"Consumer electronics\" href=\"https://en.wikipedia.org/wiki/Consumer_electronics\">consumer electronics</a>,&nbsp;<a class=\"mw-redirect\" title=\"Computer software\" href=\"https://en.wikipedia.org/wiki/Computer_software\">software</a>&nbsp;and&nbsp;<a class=\"mw-redirect\" title=\"Online service\" href=\"https://en.wikipedia.org/wiki/Online_service\">online services</a>. Founded in 1976 as Apple Computer Company by&nbsp;<a title=\"Steve Jobs\" href=\"https://en.wikipedia.org/wiki/Steve_Jobs\">Steve Jobs</a>,&nbsp;<a title=\"Steve Wozniak\" href=\"https://en.wikipedia.org/wiki/Steve_Wozniak\">Steve Wozniak</a>&nbsp;and&nbsp;<a title=\"Ronald Wayne\" href=\"https://en.wikipedia.org/wiki/Ronald_Wayne\">Ronald Wayne</a>, the company was incorporated by Jobs and Wozniak as Apple Computer, Inc. the following year. It was renamed to its current name in 2007 as the company had expanded its focus from computers to consumer electronics. Apple is considered part of the&nbsp;<a title=\"Big Tech\" href=\"https://en.wikipedia.org/wiki/Big_Tech\">Big Tech</a>&nbsp;group, alongside&nbsp;<a title=\"Nvidia\" href=\"https://en.wikipedia.org/wiki/Nvidia\">Nvidia</a>,&nbsp;<a title=\"Microsoft\" href=\"https://en.wikipedia.org/wiki/Microsoft\">Microsoft</a>,&nbsp;<a title=\"Alphabet Inc.\" href=\"https://en.wikipedia.org/wiki/Alphabet_Inc.\">Alphabet</a>,&nbsp;<a title=\"Amazon (company)\" href=\"https://en.wikipedia.org/wiki/Amazon_(company)\">Amazon</a>, and&nbsp;<a title=\"Meta Platforms\" href=\"https://en.wikipedia.org/wiki/Meta_Platforms\">Meta</a>.</p>\r\n<p>The company was founded to market Wozniak\'s&nbsp;<a title=\"Apple I\" href=\"https://en.wikipedia.org/wiki/Apple_I\">Apple I</a>&nbsp;personal computer. Its successor, the&nbsp;<a title=\"Apple II (original)\" href=\"https://en.wikipedia.org/wiki/Apple_II_(original)\">Apple II</a>, became one of the first successful mass-produced&nbsp;<a title=\"Microcomputer\" href=\"https://en.wikipedia.org/wiki/Microcomputer\">microcomputers</a>. Apple introduced the&nbsp;<a title=\"Apple Lisa\" href=\"https://en.wikipedia.org/wiki/Apple_Lisa\">Lisa</a>&nbsp;in 1983 and the&nbsp;<a title=\"Macintosh 128K\" href=\"https://en.wikipedia.org/wiki/Macintosh_128K\">Macintosh</a>&nbsp;in 1984 as some of the first computers to use a&nbsp;<a title=\"Graphical user interface\" href=\"https://en.wikipedia.org/wiki/Graphical_user_interface\">graphical user interface</a>&nbsp;and a&nbsp;<a title=\"Computer mouse\" href=\"https://en.wikipedia.org/wiki/Computer_mouse\">mouse</a>. By 1985, internal conflicts led to Jobs leaving the company to form&nbsp;<a title=\"NeXT\" href=\"https://en.wikipedia.org/wiki/NeXT\">NeXT</a>&nbsp;and Wozniak withdrawing to other ventures;&nbsp;<a title=\"John Sculley\" href=\"https://en.wikipedia.org/wiki/John_Sculley\">John Sculley</a>&nbsp;served as CEO for over a decade. In the 1990s, Apple lost considerable&nbsp;<a title=\"Market share\" href=\"https://en.wikipedia.org/wiki/Market_share\">market share</a>&nbsp;in the&nbsp;<a title=\"Personal computer\" href=\"https://en.wikipedia.org/wiki/Personal_computer\">personal computer</a>&nbsp;industry to the lower-priced&nbsp;<a title=\"Wintel\" href=\"https://en.wikipedia.org/wiki/Wintel\">Wintel</a>&nbsp;duopoly of&nbsp;<a title=\"Intel\" href=\"https://en.wikipedia.org/wiki/Intel\">Intel</a>-powered&nbsp;<a title=\"IBM PC compatible\" href=\"https://en.wikipedia.org/wiki/IBM_PC_compatible\">PC clones</a>&nbsp;running&nbsp;<a title=\"Microsoft Windows\" href=\"https://en.wikipedia.org/wiki/Microsoft_Windows\">Microsoft Windows</a>, and neared&nbsp;<a title=\"Bankruptcy\" href=\"https://en.wikipedia.org/wiki/Bankruptcy\">bankruptcy</a>&nbsp;by 1997. To overhaul its market strategy, it acquired NeXT, bringing Jobs back to the company. Under his leadership, Apple returned to profitability by introducing the&nbsp;<a title=\"IMac\" href=\"https://en.wikipedia.org/wiki/IMac\">iMac</a>,&nbsp;<a title=\"IPod\" href=\"https://en.wikipedia.org/wiki/IPod\">iPod</a>,&nbsp;<a title=\"IPhone\" href=\"https://en.wikipedia.org/wiki/IPhone\">iPhone</a>, and&nbsp;<a title=\"IPad\" href=\"https://en.wikipedia.org/wiki/IPad\">iPad</a>&nbsp;devices; creating the&nbsp;<a title=\"ITunes Store\" href=\"https://en.wikipedia.org/wiki/ITunes_Store\">iTunes Store</a>; launching the \"<a title=\"Think different\" href=\"https://en.wikipedia.org/wiki/Think_different\">Think different</a>\"&nbsp;<a title=\"Apple Inc. advertising\" href=\"https://en.wikipedia.org/wiki/Apple_Inc._advertising\">advertising</a>&nbsp;campaign; and opening the&nbsp;<a title=\"Apple Store\" href=\"https://en.wikipedia.org/wiki/Apple_Store\">Apple Store</a>&nbsp;retail chain. Jobs resigned in 2011 for health reasons, and died two months later; he was succeeded as&nbsp;<a title=\"Chief executive officer\" href=\"https://en.wikipedia.org/wiki/Chief_executive_officer\">CEO</a>&nbsp;by&nbsp;<a title=\"Tim Cook\" href=\"https://en.wikipedia.org/wiki/Tim_Cook\">Tim Cook</a>.</p>\r\n<p><a title=\"List of Apple products\" href=\"https://en.wikipedia.org/wiki/List_of_Apple_products\">Apple\'s product lineup</a>&nbsp;includes portable and home hardware like the iPhone, iPad,&nbsp;<a title=\"Apple Watch\" href=\"https://en.wikipedia.org/wiki/Apple_Watch\">Apple Watch</a>,&nbsp;<a title=\"Mac (computer)\" href=\"https://en.wikipedia.org/wiki/Mac_(computer)\">Mac</a>, and&nbsp;<a title=\"Apple TV (device)\" href=\"https://en.wikipedia.org/wiki/Apple_TV_(device)\">Apple TV</a>;&nbsp;<a title=\"List of Apple operating systems\" href=\"https://en.wikipedia.org/wiki/List_of_Apple_operating_systems\">several in-house operating systems</a>&nbsp;such as&nbsp;<a title=\"IOS\" href=\"https://en.wikipedia.org/wiki/IOS\">iOS</a>,&nbsp;<a title=\"IPadOS\" href=\"https://en.wikipedia.org/wiki/IPadOS\">iPadOS</a>, and&nbsp;<a title=\"MacOS\" href=\"https://en.wikipedia.org/wiki/MacOS\">macOS</a>; and&nbsp;<a title=\"List of software by Apple\" href=\"https://en.wikipedia.org/wiki/List_of_software_by_Apple\">various software</a>&nbsp;and services including&nbsp;<a title=\"Apple Pay\" href=\"https://en.wikipedia.org/wiki/Apple_Pay\">Apple Pay</a>&nbsp;and&nbsp;<a title=\"ICloud\" href=\"https://en.wikipedia.org/wiki/ICloud\">iCloud</a>, as well as multimedia&nbsp;<a title=\"Streaming media\" href=\"https://en.wikipedia.org/wiki/Streaming_media\">streaming</a>&nbsp;services like&nbsp;<a title=\"Apple Music\" href=\"https://en.wikipedia.org/wiki/Apple_Music\">Apple Music</a>&nbsp;and&nbsp;<a title=\"Apple TV (streaming service)\" href=\"https://en.wikipedia.org/wiki/Apple_TV_(streaming_service)\">Apple TV</a>. Since 2011, Apple has for the most part been the world\'s&nbsp;<a title=\"List of public corporations by market capitalization\" href=\"https://en.wikipedia.org/wiki/List_of_public_corporations_by_market_capitalization\">largest company by market capitalization</a>, and, as of 2024, is the&nbsp;<a title=\"List of largest manufacturing companies by revenue\" href=\"https://en.wikipedia.org/wiki/List_of_largest_manufacturing_companies_by_revenue\">largest manufacturing company by revenue</a>, the&nbsp;<a title=\"Market share of personal computer vendors\" href=\"https://en.wikipedia.org/wiki/Market_share_of_personal_computer_vendors#Current_top_vendors_market_share_(2023)\">fourth-largest personal computer vendor</a>, the&nbsp;<a title=\"Tablet computer\" href=\"https://en.wikipedia.org/wiki/Tablet_computer#By_manufacturer\">largest vendor of tablet computers</a>, and the&nbsp;<a title=\"List of best-selling mobile phones\" href=\"https://en.wikipedia.org/wiki/List_of_best-selling_mobile_phones#2024\">largest vendor of mobile phones</a>. Apple became the first&nbsp;<a title=\"Public company\" href=\"https://en.wikipedia.org/wiki/Public_company\">publicly traded</a>&nbsp;US company to be&nbsp;<a class=\"mw-redirect\" title=\"Trillion-dollar company\" href=\"https://en.wikipedia.org/wiki/Trillion-dollar_company\">valued at over $1&nbsp;trillion</a>&nbsp;in 2018, and, as of October&nbsp;2025, is valued at just over $4 trillion.</p>\r\n<p><a title=\"Criticism of Apple Inc.\" href=\"https://en.wikipedia.org/wiki/Criticism_of_Apple_Inc.\">Apple has received criticism</a>&nbsp;regarding&nbsp;<a title=\"Apple supply chain\" href=\"https://en.wikipedia.org/wiki/Apple_supply_chain\">its contractors</a>\' labor conditions,&nbsp;<a title=\"Apple Inc. and unions\" href=\"https://en.wikipedia.org/wiki/Apple_Inc._and_unions\">its relationship with trade unions</a>,&nbsp;<a title=\"Environmental impact of Apple Inc.\" href=\"https://en.wikipedia.org/wiki/Environmental_impact_of_Apple_Inc.\">its environmental practices</a>, and its corporate ethics, including&nbsp;<a class=\"mw-redirect\" title=\"Anti-competitive practices of Apple Inc.\" href=\"https://en.wikipedia.org/wiki/Anti-competitive_practices_of_Apple_Inc.\">anti-competitive tactics</a>, materials sourcing, and&nbsp;<a title=\"List of mergers and acquisitions by Apple\" href=\"https://en.wikipedia.org/wiki/List_of_mergers_and_acquisitions_by_Apple\">its acquisitions of smaller businesses</a>. Nevertheless, the company has&nbsp;<a title=\"Apple community\" href=\"https://en.wikipedia.org/wiki/Apple_community\">a large following</a>&nbsp;and enjoys&nbsp;<a title=\"Marketing of Apple Inc.\" href=\"https://en.wikipedia.org/wiki/Marketing_of_Apple_Inc.#Brand_loyalty\">a high level of customer loyalty</a>. It has consistently been ranked as one of the world\'s&nbsp;<a title=\"List of most valuable brands\" href=\"https://en.wikipedia.org/wiki/List_of_most_valuable_brands\">most valuable brands</a>&nbsp;since the late 2000s.</p>\r\n<div class=\"mw-heading mw-heading2\">\r\n<h2 id=\"History\">History</h2>\r\n</div>\r\n<div class=\"hatnote navigation-not-searchable\" role=\"note\">Main article:&nbsp;<a title=\"History of Apple Inc.\" href=\"https://en.wikipedia.org/wiki/History_of_Apple_Inc.\">History of Apple Inc.</a></div>\r\n<div class=\"mw-heading mw-heading3\">\r\n<h3 id=\"1976&ndash;1980:_Founding_and_incorporation\"><span id=\"1976.E2.80.931980:_Founding_and_incorporation\"></span>1976&ndash;1980: Founding and incorporation</h3>\r\n</div>\r\n<figure class=\"mw-default-size\"><a class=\"mw-file-description\" href=\"https://en.wikipedia.org/wiki/File:Apple_Garage.jpg\"><img class=\"mw-file-element\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/b/bd/Apple_Garage.jpg/250px-Apple_Garage.jpg\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/b/bd/Apple_Garage.jpg/500px-Apple_Garage.jpg 1.5x\" width=\"250\" height=\"167\" data-file-width=\"2048\" data-file-height=\"1365\"></a>\r\n<figcaption>In 1976,&nbsp;<a title=\"Steve Jobs\" href=\"https://en.wikipedia.org/wiki/Steve_Jobs\">Steve Jobs</a>&nbsp;and&nbsp;<a title=\"Steve Wozniak\" href=\"https://en.wikipedia.org/wiki/Steve_Wozniak\">Steve Wozniak</a>&nbsp;co-founded Apple in Jobs\'s parents\' home on Crist Drive in&nbsp;<a title=\"Los Altos, California\" href=\"https://en.wikipedia.org/wiki/Los_Altos,_California\">Los Altos, California</a>.<sup id=\"cite_ref-FOOTNOTELinzmayer20046&ndash;8_6-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-FOOTNOTELinzmayer20046%E2%80%938-6\"><span class=\"cite-bracket\">[</span>6<span class=\"cite-bracket\">]</span></a></sup>&nbsp;Wozniak called the popular belief that the company was founded in the garage \"a bit of a myth\",<sup id=\"cite_ref-7\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-7\"><span class=\"cite-bracket\">[</span>7<span class=\"cite-bracket\">]</span></a></sup>&nbsp;although they moved some operations to the garage when the bedroom became too crowded.<sup id=\"cite_ref-Linzmayer01_8-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-Linzmayer01-8\"><span class=\"cite-bracket\">[</span>8<span class=\"cite-bracket\">]</span></a></sup></figcaption>\r\n</figure>\r\n<figure class=\"mw-default-size\"><a class=\"mw-file-description\" href=\"https://en.wikipedia.org/wiki/File:2019-08-04_Apple_I_computer.jpg\"><img class=\"mw-file-element\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/2/23/2019-08-04_Apple_I_computer.jpg/250px-2019-08-04_Apple_I_computer.jpg\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/2/23/2019-08-04_Apple_I_computer.jpg/500px-2019-08-04_Apple_I_computer.jpg 1.5x\" width=\"250\" height=\"183\" data-file-width=\"4733\" data-file-height=\"3456\"></a>\r\n<figcaption>The&nbsp;<a title=\"Apple I\" href=\"https://en.wikipedia.org/wiki/Apple_I\">Apple I</a>&nbsp;is Apple\'s first product, designed by Wozniak and sold as an assembled circuit board without the required keyboard, monitor, power supply, and the optional case.</figcaption>\r\n</figure>\r\n<p><strong>Apple Computer Company</strong>&nbsp;was founded on April 1, 1976, by&nbsp;<a title=\"Steve Jobs\" href=\"https://en.wikipedia.org/wiki/Steve_Jobs\">Steve Jobs</a>,&nbsp;<a title=\"Steve Wozniak\" href=\"https://en.wikipedia.org/wiki/Steve_Wozniak\">Steve Wozniak</a>, and&nbsp;<a title=\"Ronald Wayne\" href=\"https://en.wikipedia.org/wiki/Ronald_Wayne\">Ronald Wayne</a>&nbsp;as a&nbsp;<a title=\"Partnership\" href=\"https://en.wikipedia.org/wiki/Partnership\">partnership</a>.<sup id=\"cite_ref-FOOTNOTELinzmayer20046&ndash;8_6-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-FOOTNOTELinzmayer20046%E2%80%938-6\"><span class=\"cite-bracket\">[</span>6<span class=\"cite-bracket\">]</span></a></sup><sup id=\"cite_ref-9\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-9\"><span class=\"cite-bracket\">[</span>9<span class=\"cite-bracket\">]</span></a></sup>&nbsp;The company\'s first product was the&nbsp;<a title=\"Apple I\" href=\"https://en.wikipedia.org/wiki/Apple_I\">Apple I</a>, a computer designed and hand-built entirely by Wozniak.<sup id=\"cite_ref-10\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-10\"><span class=\"cite-bracket\">[</span>10<span class=\"cite-bracket\">]</span></a></sup>&nbsp;To finance its creation, Jobs sold his&nbsp;<a title=\"Volkswagen Type 2\" href=\"https://en.wikipedia.org/wiki/Volkswagen_Type_2\">Volkswagen Bus</a>, and Wozniak sold his&nbsp;<a title=\"HP-65\" href=\"https://en.wikipedia.org/wiki/HP-65\">HP-65</a>&nbsp;calculator.<sup id=\"cite_ref-11\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-11\"><span class=\"cite-bracket\">[</span>11<span class=\"cite-bracket\">]</span></a></sup>&nbsp;Neither received the full selling price but in total earned&nbsp;$1,300&nbsp;(equivalent to $7,200 in 2024). Wozniak debuted the first prototype&nbsp;<span class=\"nowrap\">Apple I</span>&nbsp;at the&nbsp;<a title=\"Homebrew Computer Club\" href=\"https://en.wikipedia.org/wiki/Homebrew_Computer_Club\">Homebrew Computer Club</a>&nbsp;in July 1976.<sup id=\"cite_ref-12\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-12\"><span class=\"cite-bracket\">[</span>12<span class=\"cite-bracket\">]</span></a></sup>&nbsp;The Apple I was sold as a&nbsp;<a title=\"Motherboard\" href=\"https://en.wikipedia.org/wiki/Motherboard\">motherboard</a>&nbsp;with&nbsp;<a class=\"mw-redirect\" title=\"CPU\" href=\"https://en.wikipedia.org/wiki/CPU\">CPU</a>,&nbsp;<a class=\"mw-redirect\" title=\"RAM\" href=\"https://en.wikipedia.org/wiki/RAM\">RAM</a>, and basic textual-video chips&mdash;a base kit concept which was not yet marketed as a complete personal computer.<sup id=\"cite_ref-13\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-13\"><span class=\"cite-bracket\">[</span>13<span class=\"cite-bracket\">]</span></a></sup>&nbsp;It was priced soon after debut for&nbsp;$666.66&nbsp;(equivalent to $3,700 in 2024).<sup id=\"cite_ref-14\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-14\"><span class=\"cite-bracket\">[</span>14<span class=\"cite-bracket\">]</span></a></sup><sup id=\"cite_ref-FOOTNOTEWozniakSmith2006180_15-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-FOOTNOTEWozniakSmith2006180-15\"><span class=\"cite-bracket\">[</span>15<span class=\"cite-bracket\">]</span></a></sup>&nbsp;Wozniak later said he was unaware of the coincidental&nbsp;<a class=\"mw-redirect\" title=\"Mark of the beast\" href=\"https://en.wikipedia.org/wiki/Mark_of_the_beast\">mark of the beast</a>&nbsp;in the number 666, and that he came up with the price because he liked \"repeating digits\".<sup id=\"cite_ref-VintageNews_16-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-VintageNews-16\"><span class=\"cite-bracket\">[</span>16<span class=\"cite-bracket\">]</span></a></sup></p>\r\n<p><strong>Apple Computer, Inc.</strong>&nbsp;was incorporated in&nbsp;<a title=\"Cupertino, California\" href=\"https://en.wikipedia.org/wiki/Cupertino,_California\">Cupertino, California</a>,<sup id=\"cite_ref-Apple-10-K-Report-2024_2-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-Apple-10-K-Report-2024-2\"><span class=\"cite-bracket\">[</span>2<span class=\"cite-bracket\">]</span></a></sup>&nbsp;on January 3, 1977,<sup id=\"cite_ref-FOOTNOTELinzmayer200410_17-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-FOOTNOTELinzmayer200410-17\"><span class=\"cite-bracket\">[</span>17<span class=\"cite-bracket\">]</span></a></sup><sup id=\"cite_ref-Apple_FAQ_18-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-Apple_FAQ-18\"><span class=\"cite-bracket\">[</span>18<span class=\"cite-bracket\">]</span></a></sup>&nbsp;without Wayne, who had left and sold his share of the company back to Jobs and Wozniak for $800 only twelve days after having co-founded it.<sup id=\"cite_ref-19\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-19\"><span class=\"cite-bracket\">[</span>19<span class=\"cite-bracket\">]</span></a></sup>&nbsp;Multimillionaire&nbsp;<a title=\"Mike Markkula\" href=\"https://en.wikipedia.org/wiki/Mike_Markkula\">Mike Markkula</a>&nbsp;provided essential business expertise and funding of&nbsp;$250,000&nbsp;(equivalent to $1,297,000 in 2024) to Jobs and Wozniak during the incorporation of Apple.<sup id=\"cite_ref-20\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-20\"><span class=\"cite-bracket\">[</span>20<span class=\"cite-bracket\">]</span></a></sup> During the first five years of operations, revenue grew exponentially, doubling about every four months. Between September 1977 and September 1980, yearly sales grew from $775,000 to&nbsp;US$118&nbsp;million, an average annual growth</p>','2025-11-02 12:57:08','2025-11-02 12:59:51'),(5,1,'kk','Apple Inc','Apple Inc','<p><strong>Apple Inc.</strong>&nbsp;is an American multinational&nbsp;<a title=\"Technology company\" href=\"https://en.wikipedia.org/wiki/Technology_company\">technology company</a>&nbsp;headquartered in&nbsp;<a title=\"Cupertino, California\" href=\"https://en.wikipedia.org/wiki/Cupertino,_California\">Cupertino, California</a>, in&nbsp;<a title=\"Silicon Valley\" href=\"https://en.wikipedia.org/wiki/Silicon_Valley\">Silicon Valley</a>, best known for its&nbsp;<a title=\"Consumer electronics\" href=\"https://en.wikipedia.org/wiki/Consumer_electronics\">consumer electronics</a>,&nbsp;<a class=\"mw-redirect\" title=\"Computer software\" href=\"https://en.wikipedia.org/wiki/Computer_software\">software</a>&nbsp;and&nbsp;<a class=\"mw-redirect\" title=\"Online service\" href=\"https://en.wikipedia.org/wiki/Online_service\">online services</a>. Founded in 1976 as Apple Computer Company by&nbsp;<a title=\"Steve Jobs\" href=\"https://en.wikipedia.org/wiki/Steve_Jobs\">Steve Jobs</a>,&nbsp;<a title=\"Steve Wozniak\" href=\"https://en.wikipedia.org/wiki/Steve_Wozniak\">Steve Wozniak</a>&nbsp;and&nbsp;<a title=\"Ronald Wayne\" href=\"https://en.wikipedia.org/wiki/Ronald_Wayne\">Ronald Wayne</a>, the company was incorporated by Jobs and Wozniak as Apple Computer, Inc. the following year. It was renamed to its current name in 2007 as the company had expanded its focus from computers to consumer electronics. Apple is considered part of the&nbsp;<a title=\"Big Tech\" href=\"https://en.wikipedia.org/wiki/Big_Tech\">Big Tech</a>&nbsp;group, alongside&nbsp;<a title=\"Nvidia\" href=\"https://en.wikipedia.org/wiki/Nvidia\">Nvidia</a>,&nbsp;<a title=\"Microsoft\" href=\"https://en.wikipedia.org/wiki/Microsoft\">Microsoft</a>,&nbsp;<a title=\"Alphabet Inc.\" href=\"https://en.wikipedia.org/wiki/Alphabet_Inc.\">Alphabet</a>,&nbsp;<a title=\"Amazon (company)\" href=\"https://en.wikipedia.org/wiki/Amazon_(company)\">Amazon</a>, and&nbsp;<a title=\"Meta Platforms\" href=\"https://en.wikipedia.org/wiki/Meta_Platforms\">Meta</a>.</p>\r\n<p>The company was founded to market Wozniak\'s&nbsp;<a title=\"Apple I\" href=\"https://en.wikipedia.org/wiki/Apple_I\">Apple I</a>&nbsp;personal computer. Its successor, the&nbsp;<a title=\"Apple II (original)\" href=\"https://en.wikipedia.org/wiki/Apple_II_(original)\">Apple II</a>, became one of the first successful mass-produced&nbsp;<a title=\"Microcomputer\" href=\"https://en.wikipedia.org/wiki/Microcomputer\">microcomputers</a>. Apple introduced the&nbsp;<a title=\"Apple Lisa\" href=\"https://en.wikipedia.org/wiki/Apple_Lisa\">Lisa</a>&nbsp;in 1983 and the&nbsp;<a title=\"Macintosh 128K\" href=\"https://en.wikipedia.org/wiki/Macintosh_128K\">Macintosh</a>&nbsp;in 1984 as some of the first computers to use a&nbsp;<a title=\"Graphical user interface\" href=\"https://en.wikipedia.org/wiki/Graphical_user_interface\">graphical user interface</a>&nbsp;and a&nbsp;<a title=\"Computer mouse\" href=\"https://en.wikipedia.org/wiki/Computer_mouse\">mouse</a>. By 1985, internal conflicts led to Jobs leaving the company to form&nbsp;<a title=\"NeXT\" href=\"https://en.wikipedia.org/wiki/NeXT\">NeXT</a>&nbsp;and Wozniak withdrawing to other ventures;&nbsp;<a title=\"John Sculley\" href=\"https://en.wikipedia.org/wiki/John_Sculley\">John Sculley</a>&nbsp;served as CEO for over a decade. In the 1990s, Apple lost considerable&nbsp;<a title=\"Market share\" href=\"https://en.wikipedia.org/wiki/Market_share\">market share</a>&nbsp;in the&nbsp;<a title=\"Personal computer\" href=\"https://en.wikipedia.org/wiki/Personal_computer\">personal computer</a>&nbsp;industry to the lower-priced&nbsp;<a title=\"Wintel\" href=\"https://en.wikipedia.org/wiki/Wintel\">Wintel</a>&nbsp;duopoly of&nbsp;<a title=\"Intel\" href=\"https://en.wikipedia.org/wiki/Intel\">Intel</a>-powered&nbsp;<a title=\"IBM PC compatible\" href=\"https://en.wikipedia.org/wiki/IBM_PC_compatible\">PC clones</a>&nbsp;running&nbsp;<a title=\"Microsoft Windows\" href=\"https://en.wikipedia.org/wiki/Microsoft_Windows\">Microsoft Windows</a>, and neared&nbsp;<a title=\"Bankruptcy\" href=\"https://en.wikipedia.org/wiki/Bankruptcy\">bankruptcy</a>&nbsp;by 1997. To overhaul its market strategy, it acquired NeXT, bringing Jobs back to the company. Under his leadership, Apple returned to profitability by introducing the&nbsp;<a title=\"IMac\" href=\"https://en.wikipedia.org/wiki/IMac\">iMac</a>,&nbsp;<a title=\"IPod\" href=\"https://en.wikipedia.org/wiki/IPod\">iPod</a>,&nbsp;<a title=\"IPhone\" href=\"https://en.wikipedia.org/wiki/IPhone\">iPhone</a>, and&nbsp;<a title=\"IPad\" href=\"https://en.wikipedia.org/wiki/IPad\">iPad</a>&nbsp;devices; creating the&nbsp;<a title=\"ITunes Store\" href=\"https://en.wikipedia.org/wiki/ITunes_Store\">iTunes Store</a>; launching the \"<a title=\"Think different\" href=\"https://en.wikipedia.org/wiki/Think_different\">Think different</a>\"&nbsp;<a title=\"Apple Inc. advertising\" href=\"https://en.wikipedia.org/wiki/Apple_Inc._advertising\">advertising</a>&nbsp;campaign; and opening the&nbsp;<a title=\"Apple Store\" href=\"https://en.wikipedia.org/wiki/Apple_Store\">Apple Store</a>&nbsp;retail chain. Jobs resigned in 2011 for health reasons, and died two months later; he was succeeded as&nbsp;<a title=\"Chief executive officer\" href=\"https://en.wikipedia.org/wiki/Chief_executive_officer\">CEO</a>&nbsp;by&nbsp;<a title=\"Tim Cook\" href=\"https://en.wikipedia.org/wiki/Tim_Cook\">Tim Cook</a>.</p>\r\n<p><a title=\"List of Apple products\" href=\"https://en.wikipedia.org/wiki/List_of_Apple_products\">Apple\'s product lineup</a>&nbsp;includes portable and home hardware like the iPhone, iPad,&nbsp;<a title=\"Apple Watch\" href=\"https://en.wikipedia.org/wiki/Apple_Watch\">Apple Watch</a>,&nbsp;<a title=\"Mac (computer)\" href=\"https://en.wikipedia.org/wiki/Mac_(computer)\">Mac</a>, and&nbsp;<a title=\"Apple TV (device)\" href=\"https://en.wikipedia.org/wiki/Apple_TV_(device)\">Apple TV</a>;&nbsp;<a title=\"List of Apple operating systems\" href=\"https://en.wikipedia.org/wiki/List_of_Apple_operating_systems\">several in-house operating systems</a>&nbsp;such as&nbsp;<a title=\"IOS\" href=\"https://en.wikipedia.org/wiki/IOS\">iOS</a>,&nbsp;<a title=\"IPadOS\" href=\"https://en.wikipedia.org/wiki/IPadOS\">iPadOS</a>, and&nbsp;<a title=\"MacOS\" href=\"https://en.wikipedia.org/wiki/MacOS\">macOS</a>; and&nbsp;<a title=\"List of software by Apple\" href=\"https://en.wikipedia.org/wiki/List_of_software_by_Apple\">various software</a>&nbsp;and services including&nbsp;<a title=\"Apple Pay\" href=\"https://en.wikipedia.org/wiki/Apple_Pay\">Apple Pay</a>&nbsp;and&nbsp;<a title=\"ICloud\" href=\"https://en.wikipedia.org/wiki/ICloud\">iCloud</a>, as well as multimedia&nbsp;<a title=\"Streaming media\" href=\"https://en.wikipedia.org/wiki/Streaming_media\">streaming</a>&nbsp;services like&nbsp;<a title=\"Apple Music\" href=\"https://en.wikipedia.org/wiki/Apple_Music\">Apple Music</a>&nbsp;and&nbsp;<a title=\"Apple TV (streaming service)\" href=\"https://en.wikipedia.org/wiki/Apple_TV_(streaming_service)\">Apple TV</a>. Since 2011, Apple has for the most part been the world\'s&nbsp;<a title=\"List of public corporations by market capitalization\" href=\"https://en.wikipedia.org/wiki/List_of_public_corporations_by_market_capitalization\">largest company by market capitalization</a>, and, as of 2024, is the&nbsp;<a title=\"List of largest manufacturing companies by revenue\" href=\"https://en.wikipedia.org/wiki/List_of_largest_manufacturing_companies_by_revenue\">largest manufacturing company by revenue</a>, the&nbsp;<a title=\"Market share of personal computer vendors\" href=\"https://en.wikipedia.org/wiki/Market_share_of_personal_computer_vendors#Current_top_vendors_market_share_(2023)\">fourth-largest personal computer vendor</a>, the&nbsp;<a title=\"Tablet computer\" href=\"https://en.wikipedia.org/wiki/Tablet_computer#By_manufacturer\">largest vendor of tablet computers</a>, and the&nbsp;<a title=\"List of best-selling mobile phones\" href=\"https://en.wikipedia.org/wiki/List_of_best-selling_mobile_phones#2024\">largest vendor of mobile phones</a>. Apple became the first&nbsp;<a title=\"Public company\" href=\"https://en.wikipedia.org/wiki/Public_company\">publicly traded</a>&nbsp;US company to be&nbsp;<a class=\"mw-redirect\" title=\"Trillion-dollar company\" href=\"https://en.wikipedia.org/wiki/Trillion-dollar_company\">valued at over $1&nbsp;trillion</a>&nbsp;in 2018, and, as of October&nbsp;2025, is valued at just over $4 trillion.</p>\r\n<p><a title=\"Criticism of Apple Inc.\" href=\"https://en.wikipedia.org/wiki/Criticism_of_Apple_Inc.\">Apple has received criticism</a>&nbsp;regarding&nbsp;<a title=\"Apple supply chain\" href=\"https://en.wikipedia.org/wiki/Apple_supply_chain\">its contractors</a>\' labor conditions,&nbsp;<a title=\"Apple Inc. and unions\" href=\"https://en.wikipedia.org/wiki/Apple_Inc._and_unions\">its relationship with trade unions</a>,&nbsp;<a title=\"Environmental impact of Apple Inc.\" href=\"https://en.wikipedia.org/wiki/Environmental_impact_of_Apple_Inc.\">its environmental practices</a>, and its corporate ethics, including&nbsp;<a class=\"mw-redirect\" title=\"Anti-competitive practices of Apple Inc.\" href=\"https://en.wikipedia.org/wiki/Anti-competitive_practices_of_Apple_Inc.\">anti-competitive tactics</a>, materials sourcing, and&nbsp;<a title=\"List of mergers and acquisitions by Apple\" href=\"https://en.wikipedia.org/wiki/List_of_mergers_and_acquisitions_by_Apple\">its acquisitions of smaller businesses</a>. Nevertheless, the company has&nbsp;<a title=\"Apple community\" href=\"https://en.wikipedia.org/wiki/Apple_community\">a large following</a>&nbsp;and enjoys&nbsp;<a title=\"Marketing of Apple Inc.\" href=\"https://en.wikipedia.org/wiki/Marketing_of_Apple_Inc.#Brand_loyalty\">a high level of customer loyalty</a>. It has consistently been ranked as one of the world\'s&nbsp;<a title=\"List of most valuable brands\" href=\"https://en.wikipedia.org/wiki/List_of_most_valuable_brands\">most valuable brands</a>&nbsp;since the late 2000s.</p>\r\n<div class=\"mw-heading mw-heading2\">\r\n<h2 id=\"History\">History</h2>\r\n</div>\r\n<div class=\"hatnote navigation-not-searchable\" role=\"note\">Main article:&nbsp;<a title=\"History of Apple Inc.\" href=\"https://en.wikipedia.org/wiki/History_of_Apple_Inc.\">History of Apple Inc.</a></div>\r\n<div class=\"mw-heading mw-heading3\">\r\n<h3 id=\"1976&ndash;1980:_Founding_and_incorporation\"><span id=\"1976.E2.80.931980:_Founding_and_incorporation\"></span>1976&ndash;1980: Founding and incorporation</h3>\r\n</div>\r\n<figure class=\"mw-default-size\"><a class=\"mw-file-description\" href=\"https://en.wikipedia.org/wiki/File:Apple_Garage.jpg\"><img class=\"mw-file-element\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/b/bd/Apple_Garage.jpg/250px-Apple_Garage.jpg\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/b/bd/Apple_Garage.jpg/500px-Apple_Garage.jpg 1.5x\" width=\"250\" height=\"167\" data-file-width=\"2048\" data-file-height=\"1365\"></a>\r\n<figcaption>In 1976,&nbsp;<a title=\"Steve Jobs\" href=\"https://en.wikipedia.org/wiki/Steve_Jobs\">Steve Jobs</a>&nbsp;and&nbsp;<a title=\"Steve Wozniak\" href=\"https://en.wikipedia.org/wiki/Steve_Wozniak\">Steve Wozniak</a>&nbsp;co-founded Apple in Jobs\'s parents\' home on Crist Drive in&nbsp;<a title=\"Los Altos, California\" href=\"https://en.wikipedia.org/wiki/Los_Altos,_California\">Los Altos, California</a>.<sup id=\"cite_ref-FOOTNOTELinzmayer20046&ndash;8_6-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-FOOTNOTELinzmayer20046%E2%80%938-6\"><span class=\"cite-bracket\">[</span>6<span class=\"cite-bracket\">]</span></a></sup>&nbsp;Wozniak called the popular belief that the company was founded in the garage \"a bit of a myth\",<sup id=\"cite_ref-7\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-7\"><span class=\"cite-bracket\">[</span>7<span class=\"cite-bracket\">]</span></a></sup>&nbsp;although they moved some operations to the garage when the bedroom became too crowded.<sup id=\"cite_ref-Linzmayer01_8-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-Linzmayer01-8\"><span class=\"cite-bracket\">[</span>8<span class=\"cite-bracket\">]</span></a></sup></figcaption>\r\n</figure>\r\n<figure class=\"mw-default-size\"><a class=\"mw-file-description\" href=\"https://en.wikipedia.org/wiki/File:2019-08-04_Apple_I_computer.jpg\"><img class=\"mw-file-element\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/2/23/2019-08-04_Apple_I_computer.jpg/250px-2019-08-04_Apple_I_computer.jpg\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/2/23/2019-08-04_Apple_I_computer.jpg/500px-2019-08-04_Apple_I_computer.jpg 1.5x\" width=\"250\" height=\"183\" data-file-width=\"4733\" data-file-height=\"3456\"></a>\r\n<figcaption>The&nbsp;<a title=\"Apple I\" href=\"https://en.wikipedia.org/wiki/Apple_I\">Apple I</a>&nbsp;is Apple\'s first product, designed by Wozniak and sold as an assembled circuit board without the required keyboard, monitor, power supply, and the optional case.</figcaption>\r\n</figure>\r\n<p><strong>Apple Computer Company</strong>&nbsp;was founded on April 1, 1976, by&nbsp;<a title=\"Steve Jobs\" href=\"https://en.wikipedia.org/wiki/Steve_Jobs\">Steve Jobs</a>,&nbsp;<a title=\"Steve Wozniak\" href=\"https://en.wikipedia.org/wiki/Steve_Wozniak\">Steve Wozniak</a>, and&nbsp;<a title=\"Ronald Wayne\" href=\"https://en.wikipedia.org/wiki/Ronald_Wayne\">Ronald Wayne</a>&nbsp;as a&nbsp;<a title=\"Partnership\" href=\"https://en.wikipedia.org/wiki/Partnership\">partnership</a>.<sup id=\"cite_ref-FOOTNOTELinzmayer20046&ndash;8_6-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-FOOTNOTELinzmayer20046%E2%80%938-6\"><span class=\"cite-bracket\">[</span>6<span class=\"cite-bracket\">]</span></a></sup><sup id=\"cite_ref-9\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-9\"><span class=\"cite-bracket\">[</span>9<span class=\"cite-bracket\">]</span></a></sup>&nbsp;The company\'s first product was the&nbsp;<a title=\"Apple I\" href=\"https://en.wikipedia.org/wiki/Apple_I\">Apple I</a>, a computer designed and hand-built entirely by Wozniak.<sup id=\"cite_ref-10\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-10\"><span class=\"cite-bracket\">[</span>10<span class=\"cite-bracket\">]</span></a></sup>&nbsp;To finance its creation, Jobs sold his&nbsp;<a title=\"Volkswagen Type 2\" href=\"https://en.wikipedia.org/wiki/Volkswagen_Type_2\">Volkswagen Bus</a>, and Wozniak sold his&nbsp;<a title=\"HP-65\" href=\"https://en.wikipedia.org/wiki/HP-65\">HP-65</a>&nbsp;calculator.<sup id=\"cite_ref-11\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-11\"><span class=\"cite-bracket\">[</span>11<span class=\"cite-bracket\">]</span></a></sup>&nbsp;Neither received the full selling price but in total earned&nbsp;$1,300&nbsp;(equivalent to $7,200 in 2024). Wozniak debuted the first prototype&nbsp;<span class=\"nowrap\">Apple I</span>&nbsp;at the&nbsp;<a title=\"Homebrew Computer Club\" href=\"https://en.wikipedia.org/wiki/Homebrew_Computer_Club\">Homebrew Computer Club</a>&nbsp;in July 1976.<sup id=\"cite_ref-12\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-12\"><span class=\"cite-bracket\">[</span>12<span class=\"cite-bracket\">]</span></a></sup>&nbsp;The Apple I was sold as a&nbsp;<a title=\"Motherboard\" href=\"https://en.wikipedia.org/wiki/Motherboard\">motherboard</a>&nbsp;with&nbsp;<a class=\"mw-redirect\" title=\"CPU\" href=\"https://en.wikipedia.org/wiki/CPU\">CPU</a>,&nbsp;<a class=\"mw-redirect\" title=\"RAM\" href=\"https://en.wikipedia.org/wiki/RAM\">RAM</a>, and basic textual-video chips&mdash;a base kit concept which was not yet marketed as a complete personal computer.<sup id=\"cite_ref-13\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-13\"><span class=\"cite-bracket\">[</span>13<span class=\"cite-bracket\">]</span></a></sup>&nbsp;It was priced soon after debut for&nbsp;$666.66&nbsp;(equivalent to $3,700 in 2024).<sup id=\"cite_ref-14\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-14\"><span class=\"cite-bracket\">[</span>14<span class=\"cite-bracket\">]</span></a></sup><sup id=\"cite_ref-FOOTNOTEWozniakSmith2006180_15-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-FOOTNOTEWozniakSmith2006180-15\"><span class=\"cite-bracket\">[</span>15<span class=\"cite-bracket\">]</span></a></sup>&nbsp;Wozniak later said he was unaware of the coincidental&nbsp;<a class=\"mw-redirect\" title=\"Mark of the beast\" href=\"https://en.wikipedia.org/wiki/Mark_of_the_beast\">mark of the beast</a>&nbsp;in the number 666, and that he came up with the price because he liked \"repeating digits\".<sup id=\"cite_ref-VintageNews_16-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-VintageNews-16\"><span class=\"cite-bracket\">[</span>16<span class=\"cite-bracket\">]</span></a></sup></p>\r\n<p><strong>Apple Computer, Inc.</strong>&nbsp;was incorporated in&nbsp;<a title=\"Cupertino, California\" href=\"https://en.wikipedia.org/wiki/Cupertino,_California\">Cupertino, California</a>,<sup id=\"cite_ref-Apple-10-K-Report-2024_2-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-Apple-10-K-Report-2024-2\"><span class=\"cite-bracket\">[</span>2<span class=\"cite-bracket\">]</span></a></sup>&nbsp;on January 3, 1977,<sup id=\"cite_ref-FOOTNOTELinzmayer200410_17-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-FOOTNOTELinzmayer200410-17\"><span class=\"cite-bracket\">[</span>17<span class=\"cite-bracket\">]</span></a></sup><sup id=\"cite_ref-Apple_FAQ_18-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-Apple_FAQ-18\"><span class=\"cite-bracket\">[</span>18<span class=\"cite-bracket\">]</span></a></sup>&nbsp;without Wayne, who had left and sold his share of the company back to Jobs and Wozniak for $800 only twelve days after having co-founded it.<sup id=\"cite_ref-19\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-19\"><span class=\"cite-bracket\">[</span>19<span class=\"cite-bracket\">]</span></a></sup>&nbsp;Multimillionaire&nbsp;<a title=\"Mike Markkula\" href=\"https://en.wikipedia.org/wiki/Mike_Markkula\">Mike Markkula</a>&nbsp;provided essential business expertise and funding of&nbsp;$250,000&nbsp;(equivalent to $1,297,000 in 2024) to Jobs and Wozniak during the incorporation of Apple.<sup id=\"cite_ref-20\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-20\"><span class=\"cite-bracket\">[</span>20<span class=\"cite-bracket\">]</span></a></sup> During the first five years of operations, revenue grew exponentially, doubling about every four months. Between September 1977 and September 1980, yearly sales grew from $775,000 to&nbsp;US$118&nbsp;million, an average annual growth</p>','2025-11-02 12:59:51','2025-11-02 12:59:51'),(6,1,'en','Apple Inc','Apple Inc','<p><strong>Apple Inc.</strong>&nbsp;is an American multinational&nbsp;<a title=\"Technology company\" href=\"https://en.wikipedia.org/wiki/Technology_company\">technology company</a>&nbsp;headquartered in&nbsp;<a title=\"Cupertino, California\" href=\"https://en.wikipedia.org/wiki/Cupertino,_California\">Cupertino, California</a>, in&nbsp;<a title=\"Silicon Valley\" href=\"https://en.wikipedia.org/wiki/Silicon_Valley\">Silicon Valley</a>, best known for its&nbsp;<a title=\"Consumer electronics\" href=\"https://en.wikipedia.org/wiki/Consumer_electronics\">consumer electronics</a>,&nbsp;<a class=\"mw-redirect\" title=\"Computer software\" href=\"https://en.wikipedia.org/wiki/Computer_software\">software</a>&nbsp;and&nbsp;<a class=\"mw-redirect\" title=\"Online service\" href=\"https://en.wikipedia.org/wiki/Online_service\">online services</a>. Founded in 1976 as Apple Computer Company by&nbsp;<a title=\"Steve Jobs\" href=\"https://en.wikipedia.org/wiki/Steve_Jobs\">Steve Jobs</a>,&nbsp;<a title=\"Steve Wozniak\" href=\"https://en.wikipedia.org/wiki/Steve_Wozniak\">Steve Wozniak</a>&nbsp;and&nbsp;<a title=\"Ronald Wayne\" href=\"https://en.wikipedia.org/wiki/Ronald_Wayne\">Ronald Wayne</a>, the company was incorporated by Jobs and Wozniak as Apple Computer, Inc. the following year. It was renamed to its current name in 2007 as the company had expanded its focus from computers to consumer electronics. Apple is considered part of the&nbsp;<a title=\"Big Tech\" href=\"https://en.wikipedia.org/wiki/Big_Tech\">Big Tech</a>&nbsp;group, alongside&nbsp;<a title=\"Nvidia\" href=\"https://en.wikipedia.org/wiki/Nvidia\">Nvidia</a>,&nbsp;<a title=\"Microsoft\" href=\"https://en.wikipedia.org/wiki/Microsoft\">Microsoft</a>,&nbsp;<a title=\"Alphabet Inc.\" href=\"https://en.wikipedia.org/wiki/Alphabet_Inc.\">Alphabet</a>,&nbsp;<a title=\"Amazon (company)\" href=\"https://en.wikipedia.org/wiki/Amazon_(company)\">Amazon</a>, and&nbsp;<a title=\"Meta Platforms\" href=\"https://en.wikipedia.org/wiki/Meta_Platforms\">Meta</a>.</p>\r\n<p>The company was founded to market Wozniak\'s&nbsp;<a title=\"Apple I\" href=\"https://en.wikipedia.org/wiki/Apple_I\">Apple I</a>&nbsp;personal computer. Its successor, the&nbsp;<a title=\"Apple II (original)\" href=\"https://en.wikipedia.org/wiki/Apple_II_(original)\">Apple II</a>, became one of the first successful mass-produced&nbsp;<a title=\"Microcomputer\" href=\"https://en.wikipedia.org/wiki/Microcomputer\">microcomputers</a>. Apple introduced the&nbsp;<a title=\"Apple Lisa\" href=\"https://en.wikipedia.org/wiki/Apple_Lisa\">Lisa</a>&nbsp;in 1983 and the&nbsp;<a title=\"Macintosh 128K\" href=\"https://en.wikipedia.org/wiki/Macintosh_128K\">Macintosh</a>&nbsp;in 1984 as some of the first computers to use a&nbsp;<a title=\"Graphical user interface\" href=\"https://en.wikipedia.org/wiki/Graphical_user_interface\">graphical user interface</a>&nbsp;and a&nbsp;<a title=\"Computer mouse\" href=\"https://en.wikipedia.org/wiki/Computer_mouse\">mouse</a>. By 1985, internal conflicts led to Jobs leaving the company to form&nbsp;<a title=\"NeXT\" href=\"https://en.wikipedia.org/wiki/NeXT\">NeXT</a>&nbsp;and Wozniak withdrawing to other ventures;&nbsp;<a title=\"John Sculley\" href=\"https://en.wikipedia.org/wiki/John_Sculley\">John Sculley</a>&nbsp;served as CEO for over a decade. In the 1990s, Apple lost considerable&nbsp;<a title=\"Market share\" href=\"https://en.wikipedia.org/wiki/Market_share\">market share</a>&nbsp;in the&nbsp;<a title=\"Personal computer\" href=\"https://en.wikipedia.org/wiki/Personal_computer\">personal computer</a>&nbsp;industry to the lower-priced&nbsp;<a title=\"Wintel\" href=\"https://en.wikipedia.org/wiki/Wintel\">Wintel</a>&nbsp;duopoly of&nbsp;<a title=\"Intel\" href=\"https://en.wikipedia.org/wiki/Intel\">Intel</a>-powered&nbsp;<a title=\"IBM PC compatible\" href=\"https://en.wikipedia.org/wiki/IBM_PC_compatible\">PC clones</a>&nbsp;running&nbsp;<a title=\"Microsoft Windows\" href=\"https://en.wikipedia.org/wiki/Microsoft_Windows\">Microsoft Windows</a>, and neared&nbsp;<a title=\"Bankruptcy\" href=\"https://en.wikipedia.org/wiki/Bankruptcy\">bankruptcy</a>&nbsp;by 1997. To overhaul its market strategy, it acquired NeXT, bringing Jobs back to the company. Under his leadership, Apple returned to profitability by introducing the&nbsp;<a title=\"IMac\" href=\"https://en.wikipedia.org/wiki/IMac\">iMac</a>,&nbsp;<a title=\"IPod\" href=\"https://en.wikipedia.org/wiki/IPod\">iPod</a>,&nbsp;<a title=\"IPhone\" href=\"https://en.wikipedia.org/wiki/IPhone\">iPhone</a>, and&nbsp;<a title=\"IPad\" href=\"https://en.wikipedia.org/wiki/IPad\">iPad</a>&nbsp;devices; creating the&nbsp;<a title=\"ITunes Store\" href=\"https://en.wikipedia.org/wiki/ITunes_Store\">iTunes Store</a>; launching the \"<a title=\"Think different\" href=\"https://en.wikipedia.org/wiki/Think_different\">Think different</a>\"&nbsp;<a title=\"Apple Inc. advertising\" href=\"https://en.wikipedia.org/wiki/Apple_Inc._advertising\">advertising</a>&nbsp;campaign; and opening the&nbsp;<a title=\"Apple Store\" href=\"https://en.wikipedia.org/wiki/Apple_Store\">Apple Store</a>&nbsp;retail chain. Jobs resigned in 2011 for health reasons, and died two months later; he was succeeded as&nbsp;<a title=\"Chief executive officer\" href=\"https://en.wikipedia.org/wiki/Chief_executive_officer\">CEO</a>&nbsp;by&nbsp;<a title=\"Tim Cook\" href=\"https://en.wikipedia.org/wiki/Tim_Cook\">Tim Cook</a>.</p>\r\n<p><a title=\"List of Apple products\" href=\"https://en.wikipedia.org/wiki/List_of_Apple_products\">Apple\'s product lineup</a>&nbsp;includes portable and home hardware like the iPhone, iPad,&nbsp;<a title=\"Apple Watch\" href=\"https://en.wikipedia.org/wiki/Apple_Watch\">Apple Watch</a>,&nbsp;<a title=\"Mac (computer)\" href=\"https://en.wikipedia.org/wiki/Mac_(computer)\">Mac</a>, and&nbsp;<a title=\"Apple TV (device)\" href=\"https://en.wikipedia.org/wiki/Apple_TV_(device)\">Apple TV</a>;&nbsp;<a title=\"List of Apple operating systems\" href=\"https://en.wikipedia.org/wiki/List_of_Apple_operating_systems\">several in-house operating systems</a>&nbsp;such as&nbsp;<a title=\"IOS\" href=\"https://en.wikipedia.org/wiki/IOS\">iOS</a>,&nbsp;<a title=\"IPadOS\" href=\"https://en.wikipedia.org/wiki/IPadOS\">iPadOS</a>, and&nbsp;<a title=\"MacOS\" href=\"https://en.wikipedia.org/wiki/MacOS\">macOS</a>; and&nbsp;<a title=\"List of software by Apple\" href=\"https://en.wikipedia.org/wiki/List_of_software_by_Apple\">various software</a>&nbsp;and services including&nbsp;<a title=\"Apple Pay\" href=\"https://en.wikipedia.org/wiki/Apple_Pay\">Apple Pay</a>&nbsp;and&nbsp;<a title=\"ICloud\" href=\"https://en.wikipedia.org/wiki/ICloud\">iCloud</a>, as well as multimedia&nbsp;<a title=\"Streaming media\" href=\"https://en.wikipedia.org/wiki/Streaming_media\">streaming</a>&nbsp;services like&nbsp;<a title=\"Apple Music\" href=\"https://en.wikipedia.org/wiki/Apple_Music\">Apple Music</a>&nbsp;and&nbsp;<a title=\"Apple TV (streaming service)\" href=\"https://en.wikipedia.org/wiki/Apple_TV_(streaming_service)\">Apple TV</a>. Since 2011, Apple has for the most part been the world\'s&nbsp;<a title=\"List of public corporations by market capitalization\" href=\"https://en.wikipedia.org/wiki/List_of_public_corporations_by_market_capitalization\">largest company by market capitalization</a>, and, as of 2024, is the&nbsp;<a title=\"List of largest manufacturing companies by revenue\" href=\"https://en.wikipedia.org/wiki/List_of_largest_manufacturing_companies_by_revenue\">largest manufacturing company by revenue</a>, the&nbsp;<a title=\"Market share of personal computer vendors\" href=\"https://en.wikipedia.org/wiki/Market_share_of_personal_computer_vendors#Current_top_vendors_market_share_(2023)\">fourth-largest personal computer vendor</a>, the&nbsp;<a title=\"Tablet computer\" href=\"https://en.wikipedia.org/wiki/Tablet_computer#By_manufacturer\">largest vendor of tablet computers</a>, and the&nbsp;<a title=\"List of best-selling mobile phones\" href=\"https://en.wikipedia.org/wiki/List_of_best-selling_mobile_phones#2024\">largest vendor of mobile phones</a>. Apple became the first&nbsp;<a title=\"Public company\" href=\"https://en.wikipedia.org/wiki/Public_company\">publicly traded</a>&nbsp;US company to be&nbsp;<a class=\"mw-redirect\" title=\"Trillion-dollar company\" href=\"https://en.wikipedia.org/wiki/Trillion-dollar_company\">valued at over $1&nbsp;trillion</a>&nbsp;in 2018, and, as of October&nbsp;2025, is valued at just over $4 trillion.</p>\r\n<p><a title=\"Criticism of Apple Inc.\" href=\"https://en.wikipedia.org/wiki/Criticism_of_Apple_Inc.\">Apple has received criticism</a>&nbsp;regarding&nbsp;<a title=\"Apple supply chain\" href=\"https://en.wikipedia.org/wiki/Apple_supply_chain\">its contractors</a>\' labor conditions,&nbsp;<a title=\"Apple Inc. and unions\" href=\"https://en.wikipedia.org/wiki/Apple_Inc._and_unions\">its relationship with trade unions</a>,&nbsp;<a title=\"Environmental impact of Apple Inc.\" href=\"https://en.wikipedia.org/wiki/Environmental_impact_of_Apple_Inc.\">its environmental practices</a>, and its corporate ethics, including&nbsp;<a class=\"mw-redirect\" title=\"Anti-competitive practices of Apple Inc.\" href=\"https://en.wikipedia.org/wiki/Anti-competitive_practices_of_Apple_Inc.\">anti-competitive tactics</a>, materials sourcing, and&nbsp;<a title=\"List of mergers and acquisitions by Apple\" href=\"https://en.wikipedia.org/wiki/List_of_mergers_and_acquisitions_by_Apple\">its acquisitions of smaller businesses</a>. Nevertheless, the company has&nbsp;<a title=\"Apple community\" href=\"https://en.wikipedia.org/wiki/Apple_community\">a large following</a>&nbsp;and enjoys&nbsp;<a title=\"Marketing of Apple Inc.\" href=\"https://en.wikipedia.org/wiki/Marketing_of_Apple_Inc.#Brand_loyalty\">a high level of customer loyalty</a>. It has consistently been ranked as one of the world\'s&nbsp;<a title=\"List of most valuable brands\" href=\"https://en.wikipedia.org/wiki/List_of_most_valuable_brands\">most valuable brands</a>&nbsp;since the late 2000s.</p>\r\n<div class=\"mw-heading mw-heading2\">\r\n<h2 id=\"History\">History</h2>\r\n</div>\r\n<div class=\"hatnote navigation-not-searchable\" role=\"note\">Main article:&nbsp;<a title=\"History of Apple Inc.\" href=\"https://en.wikipedia.org/wiki/History_of_Apple_Inc.\">History of Apple Inc.</a></div>\r\n<div class=\"mw-heading mw-heading3\">\r\n<h3 id=\"1976&ndash;1980:_Founding_and_incorporation\"><span id=\"1976.E2.80.931980:_Founding_and_incorporation\"></span>1976&ndash;1980: Founding and incorporation</h3>\r\n</div>\r\n<figure class=\"mw-default-size\"><a class=\"mw-file-description\" href=\"https://en.wikipedia.org/wiki/File:Apple_Garage.jpg\"><img class=\"mw-file-element\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/b/bd/Apple_Garage.jpg/250px-Apple_Garage.jpg\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/b/bd/Apple_Garage.jpg/500px-Apple_Garage.jpg 1.5x\" width=\"250\" height=\"167\" data-file-width=\"2048\" data-file-height=\"1365\"></a>\r\n<figcaption>In 1976,&nbsp;<a title=\"Steve Jobs\" href=\"https://en.wikipedia.org/wiki/Steve_Jobs\">Steve Jobs</a>&nbsp;and&nbsp;<a title=\"Steve Wozniak\" href=\"https://en.wikipedia.org/wiki/Steve_Wozniak\">Steve Wozniak</a>&nbsp;co-founded Apple in Jobs\'s parents\' home on Crist Drive in&nbsp;<a title=\"Los Altos, California\" href=\"https://en.wikipedia.org/wiki/Los_Altos,_California\">Los Altos, California</a>.<sup id=\"cite_ref-FOOTNOTELinzmayer20046&ndash;8_6-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-FOOTNOTELinzmayer20046%E2%80%938-6\"><span class=\"cite-bracket\">[</span>6<span class=\"cite-bracket\">]</span></a></sup>&nbsp;Wozniak called the popular belief that the company was founded in the garage \"a bit of a myth\",<sup id=\"cite_ref-7\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-7\"><span class=\"cite-bracket\">[</span>7<span class=\"cite-bracket\">]</span></a></sup>&nbsp;although they moved some operations to the garage when the bedroom became too crowded.<sup id=\"cite_ref-Linzmayer01_8-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-Linzmayer01-8\"><span class=\"cite-bracket\">[</span>8<span class=\"cite-bracket\">]</span></a></sup></figcaption>\r\n</figure>\r\n<figure class=\"mw-default-size\"><a class=\"mw-file-description\" href=\"https://en.wikipedia.org/wiki/File:2019-08-04_Apple_I_computer.jpg\"><img class=\"mw-file-element\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/2/23/2019-08-04_Apple_I_computer.jpg/250px-2019-08-04_Apple_I_computer.jpg\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/2/23/2019-08-04_Apple_I_computer.jpg/500px-2019-08-04_Apple_I_computer.jpg 1.5x\" width=\"250\" height=\"183\" data-file-width=\"4733\" data-file-height=\"3456\"></a>\r\n<figcaption>The&nbsp;<a title=\"Apple I\" href=\"https://en.wikipedia.org/wiki/Apple_I\">Apple I</a>&nbsp;is Apple\'s first product, designed by Wozniak and sold as an assembled circuit board without the required keyboard, monitor, power supply, and the optional case.</figcaption>\r\n</figure>\r\n<p><strong>Apple Computer Company</strong>&nbsp;was founded on April 1, 1976, by&nbsp;<a title=\"Steve Jobs\" href=\"https://en.wikipedia.org/wiki/Steve_Jobs\">Steve Jobs</a>,&nbsp;<a title=\"Steve Wozniak\" href=\"https://en.wikipedia.org/wiki/Steve_Wozniak\">Steve Wozniak</a>, and&nbsp;<a title=\"Ronald Wayne\" href=\"https://en.wikipedia.org/wiki/Ronald_Wayne\">Ronald Wayne</a>&nbsp;as a&nbsp;<a title=\"Partnership\" href=\"https://en.wikipedia.org/wiki/Partnership\">partnership</a>.<sup id=\"cite_ref-FOOTNOTELinzmayer20046&ndash;8_6-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-FOOTNOTELinzmayer20046%E2%80%938-6\"><span class=\"cite-bracket\">[</span>6<span class=\"cite-bracket\">]</span></a></sup><sup id=\"cite_ref-9\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-9\"><span class=\"cite-bracket\">[</span>9<span class=\"cite-bracket\">]</span></a></sup>&nbsp;The company\'s first product was the&nbsp;<a title=\"Apple I\" href=\"https://en.wikipedia.org/wiki/Apple_I\">Apple I</a>, a computer designed and hand-built entirely by Wozniak.<sup id=\"cite_ref-10\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-10\"><span class=\"cite-bracket\">[</span>10<span class=\"cite-bracket\">]</span></a></sup>&nbsp;To finance its creation, Jobs sold his&nbsp;<a title=\"Volkswagen Type 2\" href=\"https://en.wikipedia.org/wiki/Volkswagen_Type_2\">Volkswagen Bus</a>, and Wozniak sold his&nbsp;<a title=\"HP-65\" href=\"https://en.wikipedia.org/wiki/HP-65\">HP-65</a>&nbsp;calculator.<sup id=\"cite_ref-11\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-11\"><span class=\"cite-bracket\">[</span>11<span class=\"cite-bracket\">]</span></a></sup>&nbsp;Neither received the full selling price but in total earned&nbsp;$1,300&nbsp;(equivalent to $7,200 in 2024). Wozniak debuted the first prototype&nbsp;<span class=\"nowrap\">Apple I</span>&nbsp;at the&nbsp;<a title=\"Homebrew Computer Club\" href=\"https://en.wikipedia.org/wiki/Homebrew_Computer_Club\">Homebrew Computer Club</a>&nbsp;in July 1976.<sup id=\"cite_ref-12\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-12\"><span class=\"cite-bracket\">[</span>12<span class=\"cite-bracket\">]</span></a></sup>&nbsp;The Apple I was sold as a&nbsp;<a title=\"Motherboard\" href=\"https://en.wikipedia.org/wiki/Motherboard\">motherboard</a>&nbsp;with&nbsp;<a class=\"mw-redirect\" title=\"CPU\" href=\"https://en.wikipedia.org/wiki/CPU\">CPU</a>,&nbsp;<a class=\"mw-redirect\" title=\"RAM\" href=\"https://en.wikipedia.org/wiki/RAM\">RAM</a>, and basic textual-video chips&mdash;a base kit concept which was not yet marketed as a complete personal computer.<sup id=\"cite_ref-13\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-13\"><span class=\"cite-bracket\">[</span>13<span class=\"cite-bracket\">]</span></a></sup>&nbsp;It was priced soon after debut for&nbsp;$666.66&nbsp;(equivalent to $3,700 in 2024).<sup id=\"cite_ref-14\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-14\"><span class=\"cite-bracket\">[</span>14<span class=\"cite-bracket\">]</span></a></sup><sup id=\"cite_ref-FOOTNOTEWozniakSmith2006180_15-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-FOOTNOTEWozniakSmith2006180-15\"><span class=\"cite-bracket\">[</span>15<span class=\"cite-bracket\">]</span></a></sup>&nbsp;Wozniak later said he was unaware of the coincidental&nbsp;<a class=\"mw-redirect\" title=\"Mark of the beast\" href=\"https://en.wikipedia.org/wiki/Mark_of_the_beast\">mark of the beast</a>&nbsp;in the number 666, and that he came up with the price because he liked \"repeating digits\".<sup id=\"cite_ref-VintageNews_16-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-VintageNews-16\"><span class=\"cite-bracket\">[</span>16<span class=\"cite-bracket\">]</span></a></sup></p>\r\n<p><strong>Apple Computer, Inc.</strong>&nbsp;was incorporated in&nbsp;<a title=\"Cupertino, California\" href=\"https://en.wikipedia.org/wiki/Cupertino,_California\">Cupertino, California</a>,<sup id=\"cite_ref-Apple-10-K-Report-2024_2-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-Apple-10-K-Report-2024-2\"><span class=\"cite-bracket\">[</span>2<span class=\"cite-bracket\">]</span></a></sup>&nbsp;on January 3, 1977,<sup id=\"cite_ref-FOOTNOTELinzmayer200410_17-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-FOOTNOTELinzmayer200410-17\"><span class=\"cite-bracket\">[</span>17<span class=\"cite-bracket\">]</span></a></sup><sup id=\"cite_ref-Apple_FAQ_18-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-Apple_FAQ-18\"><span class=\"cite-bracket\">[</span>18<span class=\"cite-bracket\">]</span></a></sup>&nbsp;without Wayne, who had left and sold his share of the company back to Jobs and Wozniak for $800 only twelve days after having co-founded it.<sup id=\"cite_ref-19\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-19\"><span class=\"cite-bracket\">[</span>19<span class=\"cite-bracket\">]</span></a></sup>&nbsp;Multimillionaire&nbsp;<a title=\"Mike Markkula\" href=\"https://en.wikipedia.org/wiki/Mike_Markkula\">Mike Markkula</a>&nbsp;provided essential business expertise and funding of&nbsp;$250,000&nbsp;(equivalent to $1,297,000 in 2024) to Jobs and Wozniak during the incorporation of Apple.<sup id=\"cite_ref-20\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Apple_Inc.#cite_note-20\"><span class=\"cite-bracket\">[</span>20<span class=\"cite-bracket\">]</span></a></sup> During the first five years of operations, revenue grew exponentially, doubling about every four months. Between September 1977 and September 1980, yearly sales grew from $775,000 to&nbsp;US$118&nbsp;million, an average annual growth</p>','2025-11-02 12:59:51','2025-11-02 12:59:51');
