INSERT INTO `blog_translations` VALUES (22,15,'ru','Запущен новый официальный сайт Института повышения квалификации и дополнительного образования','zapushhen-novyi-oficialnyi-sait-instituta-povyseniia-kvalifikacii-i-dopolnitelnogo-obrazovaniia','<p data-start=\"238\" data-end=\"397\">Казахский национальный университет имени аль-Фараби представляет обновлённую онлайн-платформу Института повышения квалификации и дополнительного образования.</p>\r\n<p data-start=\"399\" data-end=\"585\">На сайте собрана вся необходимая информация о деятельности института, направлениях обучения, курсах, тренингах, а также новости, объявления и материалы для преподавателей и слушателей.</p>\r\n<p data-start=\"587\" data-end=\"845\">Основная цель сайта &mdash; сделать процесс профессионального развития и непрерывного обучения более доступным и удобным. Пользователи могут ознакомиться с актуальными программами, зарегистрироваться на курсы и следить за образовательными проектами университета.</p>\r\n<p data-start=\"587\" data-end=\"845\">&nbsp;</p>\r\n<p data-start=\"847\" data-end=\"992\">Структура сайта разработана в соответствии с современными требованиями, что обеспечивает лёгкую навигацию и быстрый доступ к нужной информации.</p>\r\n<p data-start=\"994\" data-end=\"1093\"><strong data-start=\"994\" data-end=\"1014\">ipk.kaznu.edu.kz</strong> &mdash; это новая цифровая площадка для профессионального роста и обмена знаниями.</p>\r\n<p data-start=\"994\" data-end=\"1093\">&nbsp;</p>\r\n<p data-start=\"994\" data-end=\"1093\"><img src=\"blob:https://ipk.kaznu.edu.kz/34063a8e-41d8-491c-8c40-07706d496856\"></p>',NULL,NULL,'2025-10-07 09:19:45','2025-10-13 06:32:26'),(23,15,'kk','Біліктілікті арттыру және қосымша білім беру институтының жаңа ресми сайты іске қосылды','biliktilikti-arttyru-zane-qosymsa-bilim-beru-institutynyn-zana-resmi-saity-iske-qosyldy','<p data-start=\"234\" data-end=\"384\">Әл-Фараби атындағы Қазақ ұлттық университетінің <strong data-start=\"282\" data-end=\"340\">Біліктілікті арттыру және қосымша білім беру институты</strong> өз қызметін жаңа онлайн форматта ұсынуда.</p>\r\n<p data-start=\"386\" data-end=\"572\">Жаңа сайтта институттың негізгі қызмет бағыттары, оқу бағдарламалары, жаңалықтар мен хабарландырулар, сондай-ақ оқытушылар мен тыңдаушыларға арналған пайдалы ақпараттар топтастырылған.</p>\r\n<p data-start=\"574\" data-end=\"776\">Сайттың басты мақсаты &mdash; кәсіби даму мен үздіксіз білім беруді қолжетімді ету. Пайдаланушылар мұнда курстар мен тренингтер туралы мәлімет алып, тіркелу және оқу процесіне қатысу мүмкіндігіне ие болады.</p>\r\n<p data-start=\"574\" data-end=\"776\">&nbsp;</p>\r\n<p data-start=\"778\" data-end=\"886\">Сайт құрылымы заманауи талаптарға сай әзірленіп, ақпараттарды жылдам және ыңғайлы табуға мүмкіндік береді.</p>\r\n<p data-start=\"888\" data-end=\"956\"><strong data-start=\"888\" data-end=\"908\">ipk.kaznu.edu.kz</strong> &mdash; кәсіби өсу мен білім алудың жаңа кеңістігі.</p>',NULL,NULL,'2025-10-07 09:19:45','2025-10-07 09:42:44'),(24,15,'en','The new official website of the Institute for Professional Development and Continuing Education is now live','the-new-official-website-of-the-institute-for-professional-development-and-continuing-education-is-now-live','<p data-start=\"1244\" data-end=\"1395\">Al-Farabi Kazakh National University has launched the updated online platform of the Institute for Professional Development and Continuing Education.</p>\r\n<p data-start=\"1397\" data-end=\"1595\">The website provides comprehensive information about the institute&rsquo;s activities, educational programs, training courses, news, and announcements, as well as resources for instructors and learners.</p>\r\n<p data-start=\"1597\" data-end=\"1855\">The main goal of the platform is to make professional growth and lifelong learning more accessible and convenient. Visitors can explore current programs, register for training courses, and stay informed about ongoing educational projects of the university.</p>\r\n<p data-start=\"1597\" data-end=\"1855\">&nbsp;</p>\r\n<p data-start=\"1857\" data-end=\"1982\">The site&rsquo;s structure meets modern usability standards, ensuring clear navigation and quick access to essential information.</p>\r\n<p data-start=\"1984\" data-end=\"2076\"><strong data-start=\"1984\" data-end=\"2004\">ipk.kaznu.edu.kz</strong> &mdash; a digital space for professional development and knowledge sharing.</p>',NULL,NULL,'2025-10-07 09:19:45','2025-10-07 09:42:44'),(25,16,'ru','В Казахском национальном университете имени аль-Фараби начались курсы по направлениям культурология и биофизика','v-kazaxskom-nacionalnom-universitete-imeni-al-farabi-nacalis-kursy-po-napravleniiam-kulturologiia-i-biofizika','<p data-start=\"260\" data-end=\"637\">Институт повышения квалификации и дополнительного образования Казахского национального университета имени аль-Фараби запустил новые образовательные курсы, направленные на развитие профессиональных и научных компетенций слушателей. Программы разработаны в соответствии с современными требованиями системы высшего образования и сочетают теоретическую и практическую подготовку.</p>\r\n<p data-start=\"639\" data-end=\"1058\"><strong data-start=\"639\" data-end=\"671\">Основные направления курсов:</strong><br data-start=\"671\" data-end=\"674\">🔹 <em data-start=\"677\" data-end=\"692\">Культурология</em> &mdash; изучение культурных процессов, анализ взаимосвязи общественного развития и духовных ценностей, а также рассмотрение вопросов межкультурной коммуникации и современной культурной политики.<br data-start=\"881\" data-end=\"884\">🔹 <em data-start=\"887\" data-end=\"898\">Биофизика</em> &mdash; изучение физических основ живых систем, освоение новых биотехнологических подходов и применение современных методов в научной и исследовательской практике.</p>\r\n<p data-start=\"1060\" data-end=\"1332\">Цель курсов &mdash; повышение профессиональной квалификации слушателей, расширение их научного кругозора и совершенствование практических навыков. В рамках программы проводятся лекции, семинары и практические занятия с использованием современных технологий и методик обучения.</p>\r\n<p data-start=\"1334\" data-end=\"1509\">Курсы способствуют не только обмену знаниями и опыту, но и укреплению научного сотрудничества и профессионального взаимодействия между участниками образовательного процесса.</p>',NULL,NULL,'2025-10-07 10:28:45','2025-10-07 10:28:45'),(26,16,'kk','Әл-Фараби атындағы Қазақ ұлттық университетінде мәдениеттану және биофизика бағыттары бойынша курстар басталды','al-farabi-atyndagy-qazaq-ulttyq-universitetinde-madeniettanu-zane-biofizika-bagyttary-boiynsa-kurstar-bastaldy','<p data-start=\"194\" data-end=\"509\">Әл-Фараби атындағы Қазақ ұлттық университетінің <strong data-start=\"242\" data-end=\"300\">Біліктілікті арттыру және қосымша білім беру институты</strong> кәсіби дамуға бағытталған жаңа оқу курстарын бастады. Бағдарламалар жоғары білім беру жүйесінің заманауи талаптарына сай әзірленіп, тыңдаушылардың теориялық және тәжірибелік дағдыларын дамытуға бағытталған.</p>\r\n<p data-start=\"511\" data-end=\"894\"><strong data-start=\"511\" data-end=\"530\">Курс бағыттары:</strong><br data-start=\"530\" data-end=\"533\">🔹 <em data-start=\"536\" data-end=\"550\">Мәдениеттану</em> &ndash; мәдени процестерді талдау, қоғам дамуы мен рухани құндылықтардың өзара байланысын зерделеу, сондай-ақ мәдениетаралық коммуникация мен қазіргі заманғы мәдени саясат мәселелерін қамтиды.<br data-start=\"737\" data-end=\"740\">🔹 <em data-start=\"743\" data-end=\"754\">Биофизика</em> &ndash; тірі жүйелердің физикалық негіздерін зерттеу, жаңа биотехнологиялық тәсілдерді игеру және ғылыми тәжірибеде қолдану бағыттарын қамтиды.</p>\r\n<p data-start=\"896\" data-end=\"1164\">Курстардың негізгі мақсаты &ndash; тыңдаушылардың кәсіби біліктілігін арттырып, ғылыми көзқарасын кеңейту және практикалық білімін жетілдіру. Бағдарлама аясында дәрістер, семинарлар және зертханалық сабақтар өткізіліп, заманауи әдістемелер мен технологиялар пайдаланылады.</p>\r\n<p data-start=\"1166\" data-end=\"1339\">Институт ұсынған курстар қатысушыларға жаңа білім мен тәжірибе алмасу мүмкіндігін беріп қана қоймай, ғылыми ынтымақтастық пен кәсіби серіктестікті дамытуға жағдай жасайды.</p>',NULL,NULL,'2025-10-07 10:28:45','2025-10-07 10:28:45'),(27,16,'en','Al-Farabi Kazakh National University launches new courses in Cultural Studies and Biophysics','al-farabi-kazakh-national-university-launches-new-courses-in-cultural-studies-and-biophysics','<p data-start=\"1645\" data-end=\"2003\">The Institute for Professional Development and Continuing Education at Al-Farabi Kazakh National University has launched new academic programs aimed at enhancing the professional and scientific competencies of participants. These courses are designed in line with modern higher education standards and combine theoretical knowledge with practical training.</p>\r\n<p data-start=\"2005\" data-end=\"2436\"><strong data-start=\"2005\" data-end=\"2027\">Course directions:</strong><br data-start=\"2027\" data-end=\"2030\">🔹 <em data-start=\"2033\" data-end=\"2051\">Cultural Studies</em> &mdash; analysis of cultural processes, exploration of the relationship between social development and spiritual values, as well as topics in intercultural communication and contemporary cultural policy.<br data-start=\"2249\" data-end=\"2252\">🔹 <em data-start=\"2255\" data-end=\"2267\">Biophysics</em> &mdash; study of the physical principles of living systems, application of modern biotechnological methods, and integration of innovative approaches in scientific practice.</p>\r\n<p data-start=\"2438\" data-end=\"2704\">The main goal of the courses is to enhance professional qualifications, broaden scientific perspectives, and improve practical competencies. The training includes lectures, seminars, and hands-on sessions using modern educational technologies and research methods.</p>\r\n<p data-start=\"2706\" data-end=\"2872\">These programs not only foster knowledge exchange and skill development but also strengthen scientific collaboration and professional networking among participants.</p>',NULL,NULL,'2025-10-07 10:28:45','2025-10-07 10:28:45'),(33,20,'ru','В КазНУ имени аль-Фараби начались курсы по направлению энергетическая инженерия','v-kaznu-imeni-al-farabi-nacalis-kursy-po-napravleniiu-energeticeskaia-inzeneriia','<p data-start=\"1422\" data-end=\"1657\">В рамках сотрудничества между <strong data-start=\"1452\" data-end=\"1509\">Казахским национальным университетом имени аль-Фараби</strong> и <strong data-start=\"1512\" data-end=\"1574\">Каракалпакским государственным университетом имени Бердаха</strong> стартовали курсы повышения квалификации по направлению энергетическая инженерия.</p>\r\n<p data-start=\"1659\" data-end=\"1839\">Программа направлена на изучение современных методов проектирования, управления и эксплуатации энергетических систем, а также развитие практических инженерных навыков слушателей.</p>\r\n<p data-start=\"1841\" data-end=\"2166\">На физико-техническом факультете состоялся открытый урок на тему <strong data-start=\"1906\" data-end=\"1981\">&laquo;Современные стандарты и методы проектирования систем электроснабжения&raquo;</strong>, который провёл приглашённый преподаватель &mdash; <strong data-start=\"2027\" data-end=\"2163\">Отепбергенов Шукиралла, преподаватель кафедры &laquo;Энергетическая инженерия&raquo; Каракалпакского государственного университета имени Бердаха</strong>.</p>\r\n<p data-start=\"1841\" data-end=\"2166\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"2168\" data-end=\"2457\">В ходе занятия рассматривались вопросы применения действующих ГОСТов и СНиПов в области проектирования и эксплуатации систем электроснабжения, особенности инженерной графики при разработке электрических схем, а также современные подходы к цифровому моделированию энергетических объектов.</p>\r\n<p data-start=\"2459\" data-end=\"2672\">Мероприятие прошло в интерактивном формате: участники активно задавали вопросы, обсуждали реальные инженерные задачи и получали практические рекомендации по применению стандартов в профессиональной деятельности.</p>',NULL,NULL,'2025-10-09 11:36:00','2025-10-09 11:36:00'),(34,20,'kk','Әл-Фараби атындағы ҚазҰУ-де энергетикалық инженерия бағыты бойынша курстар басталды','al-farabi-atyndagy-qazuu-de-energetikalyq-inzeneriia-bagyty-boiynsa-kurstar-bastaldy','<p data-start=\"190\" data-end=\"473\">Әл-Фараби атындағы Қазақ ұлттық университетінің <strong data-start=\"238\" data-end=\"296\">Біліктілікті арттыру және қосымша білім беру институты</strong> мен <strong data-start=\"301\" data-end=\"359\">Бердах атындағы Қарақалпақ мемлекеттік университетінің</strong> бірлескен ынтымақтастығы аясында энергетикалық инженерия бағыты бойынша біліктілікті арттыру курстары басталды.</p>\r\n<p data-start=\"475\" data-end=\"627\">Бағдарлама аясында тыңдаушылар заманауи энергия жүйелерін жобалау, басқару және тиімді пайдалану әдістерімен танысып, тәжірибелік сабақтарға қатысуда.</p>\r\n<p data-start=\"629\" data-end=\"928\">Физика-техникалық факультет базасында <strong data-start=\"667\" data-end=\"748\">&laquo;Электрмен жабдықтау жүйелерін жобалаудың заманауи стандарттары мен әдістері&raquo;</strong> тақырыбында ашық сабақ өтті. Сабақты <strong data-start=\"786\" data-end=\"916\">Бердах атындағы Қарақалпақ мемлекеттік университетінің &laquo;Энергетикалық инженерия&raquo; кафедрасының оқытушысы Отепбергенов Шукиралла</strong> жүргізді.</p>\r\n<p data-start=\"930\" data-end=\"1164\">Сабақ барысында электрмен жабдықтау жүйелерін жобалау және пайдалану саласындағы қазіргі ГОСТ және СНиП талаптары, инженерлік графиканың ерекшеліктері, сонымен қатар энергетикалық нысандарды цифрлық модельдеу тәсілдері қарастырылды.</p>\r\n<p data-start=\"1166\" data-end=\"1302\">Іс-шара интерактивті форматта өтіп, тыңдаушылар өз сұрақтарын қойып, нақты инженерлік міндеттерді талқылап, тәжірибелік кеңестер алды.</p>',NULL,NULL,'2025-10-09 11:36:00','2025-10-09 11:36:00'),(35,20,'en','Training courses in Energy Engineering have started at Al-Farabi Kazakh National University','training-courses-in-energy-engineering-have-started-at-al-farabi-kazakh-national-university','<p data-start=\"2805\" data-end=\"3008\">As part of the cooperation between <strong data-start=\"2840\" data-end=\"2880\">Al-Farabi Kazakh National University</strong> and <strong data-start=\"2885\" data-end=\"2923\">Berdaq Karakalpak State University</strong>, professional development courses in <em data-start=\"2961\" data-end=\"2981\">Energy Engineering</em> have officially started.</p>\r\n<p data-start=\"3010\" data-end=\"3180\">The program focuses on mastering modern methods of design, management, and operation of energy systems, while providing participants with valuable practical experience.</p>\r\n<p data-start=\"3182\" data-end=\"3475\">An open lecture titled <strong data-start=\"3205\" data-end=\"3274\">&ldquo;Modern Standards and Methods for Designing Power Supply Systems&rdquo;</strong> was held at the Faculty of Physics and Technology. The session was conducted by <strong data-start=\"3355\" data-end=\"3382\">Shukiralla Otepbergenov</strong>, lecturer of the <em data-start=\"3400\" data-end=\"3434\">Department of Energy Engineering</em> at Berdaq Karakalpak State University.</p>\r\n<p data-start=\"3477\" data-end=\"3735\">During the lecture, participants explored the application of current GOST and SNiP standards in the design and operation of power supply systems, engineering graphics in electrical circuit development, and digital modeling techniques for energy facilities.</p>\r\n<p data-start=\"3737\" data-end=\"3955\">The event took place in an interactive format, where attendees actively asked questions, discussed real-world engineering challenges, and received practical insights for applying standards in their professional work.</p>',NULL,NULL,'2025-10-09 11:36:00','2025-10-09 11:36:00'),(53,27,'ru','Новый учебный сезон стартовал в Институте повышения квалификации и дополнительного образования','novyi-ucebnyi-sezon-startoval-v-institute-povyseniia-kvalifikacii-i-dopolnitelnogo-obrazovaniia','<p data-start=\"1714\" data-end=\"2111\">Институт повышения квалификации и дополнительного образования Казахского национального университета имени аль-Фараби открыл новый учебный сезон, предложив современные образовательные программы, направленные на развитие профессиональных компетенций и повышение квалификации специалистов. В текущем году институт проводит курсы по направлениям экономика, делопроизводство, педагогика и психология.</p>\r\n<p data-start=\"2113\" data-end=\"2431\">Среди первых слушателей &ndash; профессорско-преподавательский состав Восточно-Казахстанского университета имени Сарсена Аманжолова. Участники курсов совершенствуют свои профессиональные навыки, осваивают инновационные подходы и современные методы преподавания в соответствии с актуальными тенденциями системы образования.</p>\r\n<p data-start=\"2433\" data-end=\"2764\">Основная цель курсов &ndash; развитие профессиональной и управленческой компетентности педагогов, повышение качества образования и укрепление практических навыков, востребованных на современном рынке труда. Содержание программ сочетает в себе теоретические знания и практический опыт, соответствуя международным стандартам образования.</p>\r\n<p data-start=\"2766\" data-end=\"2989\">Обучение проводится опытными преподавателями и экспертами в своих областях. Курсы предоставляют слушателям возможность расширить горизонты профессионального роста и обменяться опытом с коллегами из разных регионов страны.</p>\r\n<p data-start=\"2991\" data-end=\"3130\">Институт приглашает всех заинтересованных специалистов присоединиться к программам и продолжить путь профессионального совершенствования.</p>',NULL,NULL,'2025-10-15 04:39:27','2025-10-15 04:39:27'),(54,27,'kk','Жаңа оқу маусымы Біліктілікті арттыру және қосымша білім беру институтында басталды','zana-oqu-mausymy-biliktilikti-arttyru-zane-qosymsa-bilim-beru-institutynda-bastaldy','<p data-start=\"302\" data-end=\"613\">Әл-Фараби атындағы Қазақ ұлттық университетінің Біліктілікті арттыру және қосымша білім беру институты жаңа оқу маусымын кәсіби білім мен тәжірибені арттыруға бағытталған оқу бағдарламаларымен бастады. Биылғы жылы институт экономика, іс жүргізу, педагогика және психология бағыттары бойынша курстарды ұсынуда.</p>\r\n<p data-start=\"615\" data-end=\"903\">Алғашқы тыңдаушылардың қатарында Шығыс Қазақстан облысындағы Сәрсен Аманжолов атындағы Шығыс Қазақстан университетінің профессор-оқытушылар құрамы бар. Олар өздерінің кәсіби біліктілігін арттырып, заманауи білім беру үрдістеріне сәйкес жаңа тәжірибелер мен әдістемелерді меңгеріп жатыр.</p>\r\n<p data-start=\"905\" data-end=\"1242\">Курстардың басты мақсаты &ndash; білім беру саласының сапасын арттыру, тыңдаушылардың кәсіби және басқарушылық дағдыларын жетілдіру, сондай-ақ еңбек нарығында сұранысқа ие жаңа құзыреттерді қалыптастыру. Бағдарламалар мазмұны теория мен практиканы ұштастыра отырып әзірленген және білім беру үдерісінің заманауи талаптарына толық сай келеді.</p>\r\n<p data-start=\"1244\" data-end=\"1434\">Институтта оқу үдерісі үздік оқытушылар мен тәжірибелі мамандардың қатысуымен жүзеге асырылады. Курстардың нәтижесінде тыңдаушылар кәсіби дамудың жаңа деңгейіне көтерілуге мүмкіндік алады.</p>\r\n<p data-start=\"1436\" data-end=\"1583\">Біліктілікті арттыру және қосымша білім беру институты барлық мүдделі мамандарды кәсіби жетістіктің жаңа белестеріне бірге қадам басуға шақырады.</p>',NULL,NULL,'2025-10-15 04:39:27','2025-10-15 04:39:27'),(55,27,'en','The New Academic Season Has Begun at the Institute for Advanced Training and Continuing Education','the-new-academic-season-has-begun-at-the-institute-for-advanced-training-and-continuing-education','<p data-start=\"3265\" data-end=\"3644\">The Institute for Advanced Training and Continuing Education of Al-Farabi Kazakh National University has officially launched a new academic season, offering updated professional development programs designed to enhance knowledge and practical skills across multiple disciplines. This year, the institute offers courses in economics, office management, pedagogy, and psychology.</p>\r\n<p data-start=\"3646\" data-end=\"3869\">Among the first participants are faculty members from Sarsen Amanzholov East Kazakhstan University, who are expanding their professional expertise and adopting innovative methods in line with modern educational standards.</p>\r\n<p data-start=\"3871\" data-end=\"4202\">The primary goal of the courses is to strengthen teaching quality, improve professional and managerial competencies, and develop practical skills that meet the demands of today&rsquo;s labor market. The programs combine theoretical foundations with applied learning, ensuring alignment with the latest trends in education and training.</p>\r\n<p data-start=\"4204\" data-end=\"4453\">The courses are conducted by qualified lecturers and field experts who emphasize interactive, experience-based learning. Participants gain not only professional growth but also valuable networking opportunities across various academic communities.</p>\r\n<p data-start=\"4455\" data-end=\"4647\">The Institute for Advanced Training and Continuing Education invites specialists from all fields to join its programs and take a confident step toward new heights of professional excellence.</p>',NULL,NULL,'2025-10-15 04:39:27','2025-10-15 04:39:27'),(56,28,'ru','В Институте повышения квалификации и дополнительного образования начались онлайн-курсы по искусственному интеллекту','v-institute-povyseniia-kvalifikacii-i-dopolnitelnogo-obrazovaniia-nacalis-onlain-kursy-po-iskusstvennomu-intellektu','<p data-start=\"2066\" data-end=\"2415\">Институт повышения квалификации и дополнительного образования Казахского национального университета имени аль-Фараби запустил&nbsp; образовательный проект, посвящённый изучению технологий искусственного интеллекта. Программа разработана в формате онлайн-обучения и направлена на развитие компетенций, востребованных в эпоху цифровой трансформации.</p>\r\n<p data-start=\"2066\" data-end=\"2415\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\"></p>\r\n<p data-start=\"2417\" data-end=\"2776\">Инициатива реализуется в русле Послания Президента Республики Казахстан Касым-Жомарта Токаева, в котором особое внимание уделяется вопросам внедрения инноваций, цифровизации и развитию человеческого капитала. Важной задачей обозначено формирование новой генерации специалистов, способных использовать современные технологии для устойчивого прогресса страны.</p>\r\n<p data-start=\"2778\" data-end=\"3093\">Курс охватывает ключевые направления искусственного интеллекта &mdash; машинное обучение, обработку данных, нейронные сети и алгоритмы прогнозирования. Слушатели получат не только теоретические знания, но и практические навыки, позволяющие применять технологии искусственного интеллекта в профессиональной деятельности.</p>\r\n<p data-start=\"3095\" data-end=\"3278\">Проект способствует расширению цифровой грамотности преподавателей, исследователей и специалистов разных отраслей, создавая условия для обмена опытом и развития научного потенциала.</p>\r\n<p data-start=\"3280\" data-end=\"3520\">Институт повышения квалификации и дополнительного образования продолжает укреплять свои позиции как центр профессионального и технологического роста, открывая новые возможности для внедрения передовых образовательных практик в Казахстане.</p>',NULL,NULL,'2025-10-15 04:50:27','2025-10-15 04:50:27'),(57,28,'kk','Біліктілікті арттыру және қосымша білім беру институтында жасанды интеллект бойынша онлайн курстар басталды','biliktilikti-arttyru-zane-qosymsa-bilim-beru-institutynda-zasandy-intellekt-boiynsa-onlain-kurstar-bastaldy','<p data-start=\"472\" data-end=\"734\">Әл-Фараби атындағы Қазақ ұлттық университетінің Біліктілікті арттыру және қосымша білім беру институты заманауи технологияларға бағытталған жаңа оқу жобасын іске қосты. Институт жасанды интеллект (ЖИ) саласы бойынша онлайн форматта курстарды бастады.</p>\r\n<p data-start=\"736\" data-end=\"1183\">Бұл бастама Қазақстан Республикасының Президенті Қасым-Жомарт Тоқаевтың &laquo;Цифрлық Қазақстан&raquo; саясаты мен елдің ғылыми-инновациялық әлеуетін арттыру жөніндегі стратегиялық тапсырмаларына сәйкес жүзеге асып отыр. Мемлекет басшысы өз Жолдауында білім мен технологияның тоғысында жаңа буын мамандарды даярлау қажеттігін атап өткен болатын. Осы бағытта ИПК ҚазҰУ нақты қадам жасап, жасанды интеллектті меңгерудің қолжетімді және сапалы моделін ұсынды.</p>\r\n<p data-start=\"1185\" data-end=\"1450\">Курс бағдарламасы заманауи машиналық оқыту, деректерді талдау, алгоритмдер және нейрожелілердің негіздерін қамтиды. Тыңдаушылар теориялық біліммен қатар, практикалық тапсырмалар арқылы нақты мысалдармен жұмыс істеп, өз кәсіби қызметінде қолдануға мүмкіндік алады.</p>\r\n<p data-start=\"1452\" data-end=\"1700\">Жобаның басты мақсаты &mdash; еліміздің білім беру және ғылыми қауымдастығы арасында цифрлық сауаттылық пен жасанды интеллектті қолдану мәдениетін кеңейту. Курстардың онлайн форматта өткізілуі өңірлердегі мамандарға да қолжетімді білім алуға жол ашады.</p>\r\n<p data-start=\"1702\" data-end=\"1914\">Институт бұл бағытты стратегиялық даму векторы ретінде айқындап, алдағы уақытта IT, деректер журналистикасы, киберқауіпсіздік және big data сияқты бағыттар бойынша да бағдарламаларды іске қосуды жоспарлап отыр.</p>',NULL,NULL,'2025-10-15 04:50:28','2025-10-15 04:50:28'),(58,28,'en','Online Courses on Artificial Intelligence Launched at the Institute for Advanced Training and Continuing Education','online-courses-on-artificial-intelligence-launched-at-the-institute-for-advanced-training-and-continuing-education','<p data-start=\"3672\" data-end=\"4017\">The Institute for Advanced Training and Continuing Education of Al-Farabi Kazakh National University has launched a new online program dedicated to the study of artificial intelligence (AI) technologies. This initiative marks another significant step toward integrating innovation and digital transformation into the national education system.</p>\r\n<p data-start=\"4019\" data-end=\"4393\">The program is aligned with the vision outlined by the President of the Republic of Kazakhstan, Kassym-Jomart Tokayev, who emphasized the importance of developing human capital and promoting digital literacy as part of the country&rsquo;s modernization strategy. By introducing AI education, the institute contributes directly to the implementation of these national priorities.</p>\r\n<p data-start=\"4395\" data-end=\"4682\">The curriculum includes core AI topics such as machine learning, data analysis, algorithm design, and neural network fundamentals. Participants will not only gain theoretical insights but also engage in practical exercises, learning to apply AI tools within their professional domains.</p>\r\n<p data-start=\"4684\" data-end=\"4993\">The initiative aims to expand digital competence and foster innovation among educators, researchers, and industry specialists throughout Kazakhstan. By offering the course in an accessible online format, the institute enables professionals from all regions to enhance their expertise regardless of location.</p>\r\n<p data-start=\"4995\" data-end=\"5303\">Looking ahead, the Institute for Advanced Training and Continuing Education plans to further expand its technological focus by introducing new programs in IT, data journalism, cybersecurity, and big data analytics &mdash; strengthening its role as a national hub for digital learning and professional excellence.</p>',NULL,NULL,'2025-10-15 04:50:28','2025-10-15 04:50:28'),(59,29,'ru','Курсы по цифровой грамотности продолжаются: слушатели серебряного возраста выражают благодарность','kursy-po-cifrovoi-gramotnosti-prodolzaiutsia-slusateli-serebrianogo-vozrasta-vyrazaiut-blagodarnost','<p data-start=\"2224\" data-end=\"2552\">В Институте повышения квалификации и дополнительного образования Казахского национального университета имени аль-Фараби продолжается реализация программы по развитию цифровой грамотности населения. Данный проект направлен на формирование у граждан практических навыков работы с современными технологиями и цифровыми сервисами.</p>\r\n<p data-start=\"2554\" data-end=\"2944\">Особое внимание уделяется обучению представителей серебряного возраста &mdash; людей старшего поколения, проявляющих высокую заинтересованность в освоении цифрового пространства. Для них разработаны специальные обучающие модули, охватывающие темы безопасного пользования интернетом, работы с электронными государственными услугами, онлайн-оплатами, мобильными приложениями и социальными сетями.</p>\r\n<p data-start=\"2946\" data-end=\"3306\">Программа курса сочетает теорию и практику. Слушатели осваивают работу с текстовыми и графическими документами, учатся создавать электронную почту, пользоваться онлайн-платформами для коммуникации и обмена данными. Особый акцент сделан на информационной безопасности и распознавании фейковых новостей &mdash; навыках, актуальных для современного медиапространства.</p>\r\n<p data-start=\"2946\" data-end=\"3306\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"3308\" data-end=\"3505\">Участники курсов отмечают, что обучение проходит в дружеской атмосфере, преподаватели объясняют материал просто и доступно, а полученные знания помогают чувствовать себя уверенно в цифровом мире.</p>\r\n<p data-start=\"3507\" data-end=\"3863\">Руководство института подчеркивает, что данный проект реализуется в контексте Послания Президента Республики Казахстан Касым-Жомарта Токаева, где цифровизация и развитие человеческого капитала определены приоритетами государственной политики. Повышение цифровой грамотности граждан способствует их социальной активности и интеграции в цифровую экономику.</p>\r\n<p data-start=\"3865\" data-end=\"4100\">Курсы продолжают набирать обороты, и к ним присоединяются новые участники из разных регионов страны. Институт приглашает всех желающих сделать шаг навстречу современным технологиям и открыть для себя новые возможности цифрового мира.</p>',NULL,NULL,'2025-10-15 05:07:21','2025-10-15 05:07:21'),(60,29,'kk','Күміс жастағы азаматтар цифрлық сауаттылық курстарына белсенді қатысуда','kumis-zastagy-azamattar-cifrlyq-sauattylyq-kurstaryna-belsendi-qatysuda','<p data-start=\"307\" data-end=\"634\">Әл-Фараби атындағы Қазақ ұлттық университетінің Біліктілікті арттыру және қосымша білім беру институтында цифрлық сауаттылыққа арналған курстар жалғасуда. Бұл бағдарлама &ndash; ел азаматтарының цифрлық дағдыларын арттыру және жаңа технологияларды күнделікті өмірде тиімді қолдануға үйретуге бағытталған маңызды әлеуметтік бастама.</p>\r\n<p data-start=\"636\" data-end=\"1039\">Курстардың ерекшелігі &ndash; білім алу мүмкіндігін өмірдің барлық кезеңінде сақтау қағидасына негізделуі. Әсіресе күміс жастағы (зиялы зейнет жасы мен егде буын) тыңдаушылар бұл бағдарламаны ерекше ықыласпен қабылдады. Олар үшін компьютерлік сауаттылық пен интернеттегі қауіпсіздік, мемлекеттік электронды қызметтерді пайдалану, смартфон мен онлайн платформалармен жұмыс істеу секілді тақырыптар қамтылған.</p>\r\n<p data-start=\"1041\" data-end=\"1374\">Курс барысында қатысушылар eGov.kz және Kaspi.kz сияқты танымал онлайн сервистерді пайдалануды, PDF және Word құжаттарымен жұмыс істеуді, электронды пошта мен мессенджерлерді қауіпсіз қолдануды меңгереді. Сонымен қатар, әлеуметтік желілерде ақпараттық гигиенаны сақтау мен жалған ақпаратты ажырату мәселелеріне де назар аударылады.</p>\r\n<p data-start=\"1376\" data-end=\"1625\">Тыңдаушылардың айтуынша, курс мазмұны түсінікті, практикалық тұрғыдан пайдалы әрі заманауи талаптарға сай. Көпшілігі жаңа технологияларды меңгерудің өз өмірін жеңілдетіп қана қоймай, қоғам өміріне белсенді араласуға мүмкіндік беретінін атап өтуде.</p>\r\n<p data-start=\"1627\" data-end=\"1920\">Институт өкілдерінің мәлімдеуінше, цифрлық сауаттылық бағытындағы бұл жоба &ndash; ел Президентінің &laquo;Білімді ұлт&raquo; қағидатын іске асыруға қосылған нақты үлес. Бағдарлама қатысушыларды цифрлық ортада сенімді әрекет етуге үйретіп, егде жастағы азаматтардың қоғамдағы белсенділігін арттыруды көздейді.</p>\r\n<p data-start=\"1922\" data-end=\"2090\">Курстар алдағы уақытта да жалғасады. Институт мамандары барлық ниет білдірген азаматтарды цифрлық білімге қадам басуға және заманауи технологияларды игеруге шақырады.</p>',NULL,NULL,'2025-10-15 05:07:21','2025-10-15 05:07:21'),(61,29,'en','Digital Literacy Courses Continue: Participants of the Silver Age Express Satisfaction','digital-literacy-courses-continue-participants-of-the-silver-age-express-satisfaction','<p data-start=\"4224\" data-end=\"4596\">The Institute for Advanced Training and Continuing Education of Al-Farabi Kazakh National University continues its digital literacy program aimed at enhancing citizens&rsquo; ability to navigate the modern technological environment. This initiative plays a crucial role in promoting lifelong learning and supporting the President&rsquo;s vision of building a &ldquo;Knowledgeable Nation.&rdquo;</p>\r\n<p data-start=\"4598\" data-end=\"4891\">A special focus of the program is on participants of the &ldquo;silver age&rdquo; &mdash; older adults who show great enthusiasm for acquiring digital skills. The courses are designed to help them confidently use computers, smartphones, and online services, ensuring full inclusion in today&rsquo;s digital society.</p>\r\n<p data-start=\"4893\" data-end=\"5260\">The curriculum includes practical modules on safe internet usage, accessing government e-services, managing online payments, working with documents, and using popular applications such as eGov.kz and Kaspi.kz. Participants also learn about digital hygiene, protecting personal data, and identifying fake information &mdash; essential skills in the modern media landscape.</p>\r\n<p data-start=\"5262\" data-end=\"5543\">According to attendees, the lessons are engaging, accessible, and directly relevant to their daily lives. Many note that the acquired knowledge helps them stay connected with family, manage finances independently, and participate more actively in community and civic initiatives.</p>\r\n<p data-start=\"5545\" data-end=\"5922\">Representatives of the institute emphasize that the project directly supports Kazakhstan&rsquo;s national digital transformation agenda, aligning with President Kassym-Jomart Tokayev&rsquo;s message on the importance of technological education and human capital development. The program not only improves digital literacy but also fosters social inclusion and intergenerational dialogue.</p>\r\n<p data-start=\"5924\" data-end=\"6177\">The courses will continue in the coming months, expanding their reach to new regions. The Institute for Advanced Training and Continuing Education invites all interested citizens to join the movement toward a digitally empowered and inclusive society.</p>',NULL,NULL,'2025-10-15 05:07:21','2025-10-15 05:07:21'),(65,31,'ru','Для сотрудников Центра «Активное долголетие» организован курс по цифровой грамотности и искусственному интеллекту','dlia-sotrudnikov-centra-aktivnoe-dolgoletie-organizovan-kurs-po-cifrovoi-gramotnosti-i-iskusstvennomu-intellektu','<p>Институт повышения квалификации организовал специальный курс по основам цифровой грамотности и искусственного интеллекта для сотрудников Центра &laquo;Активное долголетие&raquo;. В ходе обучения специалисты центра получили необходимые знания и практические навыки для эффективного использования современных цифровых технологий в своей работе.</p>\r\n<p><img src=\"data:image/jpeg;base64,\"></p>\r\n<p>В рамках программы участники проанализировали значение искусственного интеллекта в современном мире и познакомились с основами кибербезопасности. Особое внимание преподаватели уделили вопросам защиты персональных данных и соблюдения правил кибергигиены в онлайн-пространстве.</p>\r\n<p>Кроме того, в рамках курса был проведен практический блок по работе с языковой моделью, основанной на технологии искусственного интеллекта ChatGPT. Сотрудники центра научились эффективно использовать инструмент ChatGPT для получения информации и написания текста. Освоение этого инструмента поможет им оказывать информационную поддержку посетителям центра и оптимизировать внутренние рабочие процессы.</p>\r\n<p><img src=\"data:image/jpeg;base64,\"></p>\r\n<p>Другая часть курса была посвящена освоению основных приемов видеомонтажа с помощью смартфона. Участникам показали, как создавать и монтировать видео прямо на мобильных устройствах. Это позволит им разрабатывать привлекательные медиаматериалы для мероприятий центра.</p>\r\n<p>Кроме того, на курсе были представлены современные методы создания видеороликов с использованием искусственного интеллекта. Участники освоили новые инструменты, позволяющие автоматически создавать видеоролики на основе текста или изображений. Это расширит их возможности в подготовке обучающих и информационных материалов.</p>\r\n<p>Ожидается, что этот комплексный курс поможет сотрудникам Центра &laquo;Активное долголетие&raquo; эффективно внедрять новые цифровые решения в свою работу. Повышение цифровой грамотности и освоение технологий искусственного интеллекта позволит специалистам центра улучшить качество услуг, предоставляемых пожилым людям.</p>',NULL,NULL,'2025-10-30 08:42:01','2025-10-30 08:44:59');
INSERT INTO `blog_translations` VALUES (66,31,'kk','Белсенді ұзақ өмір орталығы қызметкерлеріне цифрлық сауаттылық және жасанды интеллект бойынша курс ұйымдастырылды','belsendi-uzaq-omir-ortalygy-qyzmetkerlerine-cifrlyq-sauattylyq-zane-zasandy-intellekt-boiynsa-kurs-uiymdastyryldy','<p data-start=\"147\" data-end=\"475\">Біліктілікті арттыру институты Белсенді ұзақ өмір сүру орталығының қызметкерлеріне арналған цифрлық сауаттылық және жасанды интеллект негіздері бойынша арнайы курс ұйымдастырды. Оқыту барысында орталық мамандары қазіргі заманғы цифрлық технологияларды өз жұмысында тиімді пайдалануға қажетті білім мен тәжірибелік дағдылар алды.</p>\r\n<p data-start=\"147\" data-end=\"475\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"477\" data-end=\"730\">Бағдарлама аясында тыңдаушылар жасанды интеллекттің қазіргі әлемдегі маңыздылығын талдап, киберқауіпсіздік негіздерімен танысты. Оқытушылар интернет кеңістігінде жеке деректерді қорғау және кибергигиена ережелерін сақтау мәселелеріне ерекше көңіл бөлді.</p>\r\n<p data-start=\"732\" data-end=\"1120\">Сонымен қатар, курс барысында ChatGPT жасанды интеллект технологиясына негізделген тілдік модельмен жұмыс істеу бойынша практикалық бөлім өткізілді. Орталық қызметкерлері ChatGPT құралын ақпарат алу және мәтін құрастыру мақсатында тиімді пайдалануды үйренді. Бұл құралды меңгеру оларға орталыққа келушілерге ақпараттық қолдау көрсету мен ішкі жұмыс үдерістерін оңтайландыруға көмектеседі.</p>\r\n<p data-start=\"1122\" data-end=\"1404\">Курстың тағы бір бөлігі смартфон арқылы бейнемонтаж жасаудың негізгі әдістерін меңгеруге арналды. Тыңдаушыларға мобильді құрылғыларда тікелей бейнероликтер құру және өңдеу жолдары көрсетілді. Бұл оларға орталықтың іс-шараларында тартымды медиаматериалдар әзірлеуге мүмкіндік береді.</p>\r\n<p data-start=\"1122\" data-end=\"1404\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"1406\" data-end=\"1734\">Бұдан бөлек, курста жасанды интеллект көмегімен видео генерациялау бойынша заманауи әдістер таныстырылды. Тыңдаушылар мәтін немесе кескін негізінде автоматты түрде бейнеролик жасауға мүмкіндік беретін жаңа құралдармен жұмыс істеуді үйренді. Бұл олардың оқу-ағарту және ақпараттық материалдарды дайындау мүмкіндіктерін кеңейтеді.</p>\r\n<p data-start=\"1736\" data-end=\"2057\">Осы кешенді курс Белсенді ұзақ өмір сүру орталығы қызметкерлерінің жұмысына жаңа цифрлық шешімдерді тиімді енгізуге септігін тигізеді деп күтілуде. Цифрлық сауаттылықты арттырып, жасанды интеллект технологияларын игеру орталық мамандарына аға буын өкілдеріне көрсетілетін қызметтердің сапасын жақсартуға мүмкіндік береді.</p>',NULL,NULL,'2025-10-30 08:42:01','2025-10-30 08:44:59'),(67,31,'en','Digital Literacy and Artificial Intelligence Course Organized for Active Longevity Center Employees','digital-literacy-and-artificial-intelligence-course-organized-for-active-longevity-center-employees','<p data-start=\"2188\" data-end=\"2527\">The Institute of Advanced Training organized a special course on digital literacy and the fundamentals of artificial intelligence for the employees of the Center for Active Longevity. During the training, the center\'s staff acquired the knowledge and practical skills necessary to effectively use modern digital technologies in their work.</p>\r\n<p data-start=\"2188\" data-end=\"2527\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"2529\" data-end=\"2838\">As part of the program, the participants examined the importance of artificial intelligence in today\'s world and became familiar with the fundamentals of cybersecurity. The instructors placed special emphasis on protecting personal data and following cyber hygiene rules when working in an online environment.</p>\r\n<p data-start=\"2840\" data-end=\"3222\">In addition, the course included a practical module on working with ChatGPT, a language model based on artificial intelligence technology. The center\'s employees learned to use ChatGPT effectively for obtaining information and generating content. Mastering this technology will help them provide informational support to the center&rsquo;s visitors and streamline internal work processes.</p>\r\n<p data-start=\"3224\" data-end=\"3512\">Another part of the course was dedicated to mastering the basics of video editing using smartphones. The participants were shown how to create and edit videos directly on mobile devices. This skill will enable them to produce engaging media content for the center\'s events and activities.</p>\r\n<p data-start=\"3224\" data-end=\"3512\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"3514\" data-end=\"3807\">Furthermore, the training introduced modern methods of video generation using artificial intelligence. The participants learned to use new tools that allow automatic creation of videos based on text or images, expanding their capabilities in developing educational and informational materials.</p>\r\n<p data-start=\"3809\" data-end=\"4179\" data-is-last-node=\"\" data-is-only-node=\"\">This comprehensive course is expected to contribute to the effective implementation of new digital solutions in the work of the Center for Active Longevity\'s staff. By improving their digital literacy and mastering artificial intelligence technologies, the center&rsquo;s specialists will be better equipped to enhance the quality of services provided to the older generation.</p>',NULL,NULL,'2025-10-30 08:42:01','2025-10-30 08:44:59'),(68,32,'ru','Слушатели Ташкентского государственного экономического университета проходят обучение в КазНУ','slusateli-taskentskogo-gosudarstvennogo-ekonomiceskogo-universiteta-proxodiat-obucenie-v-kaznu','<p><span lang=\"ru-KZ\" style=\"font-size: 14.0pt;\">&nbsp; &nbsp; <span style=\"font-size: 12pt;\">&nbsp; &nbsp; &nbsp;<span style=\"font-size: 14pt;\">В Институте повышения квалификации и дополнительного образования Казахского национального университета имени аль-Фараби стартовали курсы для преподавателей <strong>Ташкентского государственного экономического университета</strong>.</span></span></span></p>\r\n<p><span lang=\"ru-KZ\" style=\"font-size: 14.0pt;\"><span style=\"font-size: 12pt;\"><span style=\"font-size: 14pt;\"><img src=\"data:image/jpeg;base64,\"></span></span></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;\"><span lang=\"ru-KZ\" style=\"font-size: 14.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: #0C00;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Программа направлена на укрепление образовательного сотрудничества между Казахстаном и Узбекистаном, развитие цифровых компетенций и освоение современных образовательных технологий. В рамках курса участники изучают <strong>искусственный интеллект</strong>, <strong>цифровую экономику</strong>, <strong>современное управление</strong>, а также <strong>педагогические инновации</strong>.</span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;\"><span lang=\"ru-KZ\" style=\"font-size: 14.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: #0C00;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Занятия проходят в интерактивном формате: проводятся лекции, практические тренинги и групповые обсуждения. Преподаватели из Узбекистана отметили высокий уровень организации учебного процесса и выразили благодарность за возможность обмена опытом. </span><span lang=\"ru-KZ\" style=\"font-size: 14.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: #0C00;\">Такие образовательные инициативы способствуют развитию международного академического партнерства и интеграции Центрально-Азиатского образовательного пространства.</span></p>',NULL,NULL,'2025-10-30 08:50:40','2025-10-30 08:50:40'),(69,32,'kk','Ташкент мемлекеттік экономикалық университетінің тыңдаушылары ҚазҰУ-да біліктілігін арттыруда','taskent-memlekettik-ekonomikalyq-universitetinin-tyndausylary-qazuu-da-biliktiligin-arttyruda','<p><span lang=\"ru-KZ\" style=\"font-size: 14.0pt; color: black; mso-themecolor: text1;\">Әл-Фараби атындағы Қазақ ұлттық университетінің <strong>Біліктілікті арттыру және қосымша білім беру институты</strong> өз тәжірибесін халықаралық деңгейде кеңейтуді жалғастыруда. Осы аптада институт қабырғасында <strong>Ташкент мемлекеттік экономикалық университетінің</strong> профессор-оқытушылар құрамы келіп, арнайы біліктілікті арттыру курстарына қатысуда.</span></p>\r\n<p><span lang=\"ru-KZ\" style=\"font-size: 14.0pt; color: black; mso-themecolor: text1;\"><img src=\"data:image/jpeg;base64,\"></span></p>\r\n<p><span lang=\"ru-KZ\" style=\"font-size: 14.0pt; color: black; mso-themecolor: text1;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Курстардың басты мақсаты &mdash; кәсіби құзыреттілікті жетілдірумен қатар, Қазақстан мен Өзбекстан арасындағы білім беру саласындағы ынтымақтастықты жаңа деңгейге көтеру. Бағдарлама аясында тыңдаушылар <strong>жасанды интеллект</strong>, <strong>цифрлық трансформация</strong>, <strong>экономика және басқару</strong>, <strong>педагогикалық инновациялар</strong> бағыттары бойынша дәрістер мен тәжірибелік сабақтарға қатысуда.</span></p>\r\n<p><span lang=\"ru-KZ\" style=\"font-size: 14.0pt; color: black; mso-themecolor: text1;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Сабақтар интерактивті форматта ұйымдастырылып, қатысушылар тәжірибе алмасуға, жаңа білім беру тәсілдерін игеруге және цифрлық шешімдерді оқу процесіне енгізуге мүмкіндік алуда. Университеттің ғылыми-инновациялық инфрақұрылымымен танысқан өзбекстандық мамандар ҚазҰУ-дың білім сапасына жоғары баға берді. </span><span lang=\"ru-KZ\" style=\"font-size: 14.0pt; color: black; mso-themecolor: text1;\">Мұндай өзара байланыстар екі ел арасындағы академиялық серіктестікті нығайтып қана қоймай, Орталық Азиядағы білім беру интеграциясын жаңа белеске шығарады.</span></p>',NULL,NULL,'2025-10-30 08:50:40','2025-10-30 08:50:40'),(70,32,'en','Faculty from Tashkent State University of Economics Begin Training at Al-Farabi KazNU','faculty-from-tashkent-state-university-of-economics-begin-training-at-al-farabi-kaznu','<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify;\"><span lang=\"ru-KZ\" style=\"font-size: 14.0pt; line-height: 107%;\">&nbsp; &nbsp; &nbsp; &nbsp; The <strong>Institute for Advanced Training and Continuing Education</strong> of <em>Al-Farabi Kazakh National University</em> continues to expand its international cooperation. This week, faculty members from the <strong>Tashkent State University of Economics</strong> began their professional development courses in Almaty.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify;\"><span lang=\"ru-KZ\" style=\"font-size: 14.0pt; line-height: 107%;\"><img src=\"data:image/jpeg;base64,\"></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\"><span lang=\"ru-KZ\" style=\"font-size: 14.0pt; font-family: \'Times New Roman\',serif;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>The program focuses on enhancing professional qualifications, fostering academic collaboration between Kazakhstan and Uzbekistan, and promoting digital literacy and innovation in education. Participants are engaged in lectures and workshops on <strong>Artificial Intelligence</strong>, <strong>Digital Economy</strong>, <strong>Modern Management</strong>, and <strong>Pedagogical Innovations</strong>.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\"><span lang=\"ru-KZ\" style=\"font-size: 14.0pt; font-family: \'Times New Roman\',serif;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>The training sessions combine theory and practice, offering participants opportunities for dialogue, experience exchange, and the development of interdisciplinary approaches. Guests also explored KazNU&rsquo;s research and innovation centers, expressing appreciation for the university&rsquo;s modern infrastructure and academic excellence. </span><span lang=\"ru-KZ\" style=\"font-size: 14.0pt; line-height: 107%;\">This partnership reinforces academic and cultural exchange between the two nations, contributing to a shared educational ecosystem across Central Asia.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal;\"><span lang=\"ru-KZ\" style=\"font-size: 14.0pt; font-family: \'Times New Roman\',serif;\">&nbsp;</span></p>',NULL,NULL,'2025-10-30 08:50:40','2025-10-30 08:50:40'),(71,33,'ru','Визит делегации из Кыргызстана в алматинский Центр активного долголетия','vizit-delegacii-iz-kyrgyzstana-v-almatinskii-centr-aktivnogo-dolgoletiia','<p data-start=\"8146\" data-end=\"9042\">В конце октября 2025 года, при содействии Института повышения квалификации и дополнительного образования Казахского национального университета имени аль-Фараби, делегация из Кыргызской Республики посетила городской <strong data-start=\"8361\" data-end=\"8391\">Центр активного долголетия</strong> в Алматы. В состав делегации вошли представители государственных и общественных организаций Кыргызстана, прибывшие для обмена опытом между двумя странами и ознакомления с современными методами развития культуры активного образа жизни у пожилых граждан. В ходе визита гости из Кыргызстана проявили большой интерес к работе центра, его социально-образовательным программам для пенсионеров, а также к проекту <strong data-start=\"8837\" data-end=\"8865\">&laquo;Серебряный университет&raquo;</strong>, реализуемому на базе КазНУ и предоставляющему пожилым людям возможности для продолжения обучения.</p>\r\n<p data-start=\"8146\" data-end=\"9042\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"9102\" data-end=\"11120\">Казахстан поделился с кыргызскими коллегами обширным опытом в сфере активного долголетия. С момента открытия первых центров активного долголетия в 2020 году в республике была создана разветвлённая сеть таких учреждений &ndash; сегодня в стране действуют 120 центров, 57 из них в городах и 63 в сельской местности.&nbsp;Деятельность этих центров является одним из приоритетов социальной политики и направлена на поддержку старшего поколения, создание условий для их активной и насыщенной жизни. В Алматы делегацию ознакомили с работой одного из таких центров, который предоставляет услуги по принципу &laquo;одного окна&raquo; сразу по нескольким направлениям. Гости увидели, как центр организует для пожилых людей разнообразные бесплатные занятия &ndash; оздоровительную гимнастику, скандинавскую ходьбу, йогу, творческие кружки, культурно-досуговые мероприятия, а также обучающие курсы (например, компьютерная и цифровая грамотность, изучение языков). Кроме того, центр обеспечивает социально-медицинскую, психологическую и правовую поддержку пенсионерам, проводит лекции по безопасности и финансовой грамотности. Такой современный комплексный подход наглядно демонстрирует, как в Казахстане стимулируют активное долголетие и улучшают качество жизни пожилых людей. Представители кыргызской делегации высоко оценили предоставляемые услуги и отметили, что подобные меры мотивируют старшее поколение вести активный образ жизни и участвовать в общественной жизни. В ходе обсуждений стороны обменялись информацией о национальных программах: казахстанские специалисты поделились практическими решениями, а кыргызские &ndash; рассказали о подготовке Государственной программы по активному долголетию на 2025&ndash;2030 годы, цель которой &ndash; повысить качество жизни пожилых граждан Кыргызстана.</p>\r\n<h2 data-start=\"11122\" data-end=\"11184\">Образовательные программы и проект &laquo;Серебряный университет&raquo;</h2>\r\n<p data-start=\"11186\" data-end=\"12803\">Особое внимание во время визита было уделено образовательным инициативам для людей старшего поколения. Казахстанские коллеги представили проект <strong data-start=\"11330\" data-end=\"11358\">&laquo;Серебряный университет&raquo;</strong> &ndash; международное движение, направленное на обучение и развитие граждан пенсионного возраста. Этот проект, запущенный КазНУ весной 2024 года, открывает перед людьми старше 50 лет новые возможности: они могут повысить свою квалификацию, получить новую профессию или освоить навыки в интересующих их областях. Делегации рассказали, что в рамках &laquo;Серебряного университета&raquo; для слушателей в возрасте проводятся курсы по самым разным направлениям &ndash; от основ компьютерной грамотности и иностранных языков до занятий по искусству, здоровому образу жизни и участию в волонтёрских проектах. По словам представителей КазНУ, цель &laquo;Серебряного университета&raquo; &ndash; поддержать обучение после 50 лет, улучшить качество жизни пожилых людей и дать положительный пример молодому поколению&nbsp;Гости из Кыргызстана проявили большой интерес к этой программе непрерывного образования. Их особенно заинтересовал опыт организации обучения для пенсионеров: начиная от набора слушателей и разработки специальных учебных курсов до привлечения квалифицированных преподавателей и волонтёров. Стороны обсудили возможность внедрения подобных курсов в Кыргызстане, чтобы и там повысить вовлечённость пожилых людей в образовательные, научные и творческие деятельности, тем самым усилив их социальную активность и жизненный тонус.</p>\r\n<h2 data-start=\"12805\" data-end=\"12858\">Перспективы совместных проектов и значение встречи</h2>\r\n<p data-start=\"12860\" data-end=\"14151\">Визит кыргызской делегации носил не только ознакомительный, но и стратегический характер с точки зрения дальнейшего сотрудничества. Представители двух стран выразили обоюдное намерение развивать партнерство в сфере активного долголетия и социальной поддержки пожилых людей. В частности, были обсуждены перспективы организации ответных визитов казахстанских специалистов в Кыргызстан, проведения совместных семинаров, тренингов и обмена экспертами для продолжения обмена опытом. Подобные инициативы, по мнению обеих сторон, имеют важное социальное и культурное значение: они позволяют укреплять дружеские связи между народами и продвигать общее гуманитарное измерение двусторонних отношений. Встреча в Алматы продемонстрировала, что Казахстан и Кыргызстан разделяют ценности уважения к старшему поколению и стремятся совместно искать инновационные подходы к решению демографических вызовов. Таким образом, данный визит стал важным шагом на пути укрепления сотрудничества между двумя странами и формирования новой платформы для обмена опытом в области активного долголетия. Обе стороны договорились поддерживать постоянный диалог и прорабатывать конкретные совместные проекты и инициативы в интересах граждан старшего возраста в Казахстане и Кыргызстане.</p>\r\n<p data-start=\"14168\" data-end=\"14981\">В целом визит делегации из Кыргызстана в алматинский Центр активного долголетия &ndash; при организационной поддержке КазНУ &ndash; прошёл продуктивно и успешно. Он позволил на практике обменяться знаниями и лучшими практиками по поддержке пожилых людей, познакомил кыргызских коллег с передовым казахстанским опытом в данной сфере, а казахстанским специалистам дал возможность узнать о подходах соседней страны. Подобные встречи существенно расширяют рамки казахстанско-кыргызстанского сотрудничества, наполняя его новым содержанием в социально-гуманитарной области. Взаимное стремление помогать старшему поколению сближает наши страны и народы, а совместная работа над проектами активного долголетия станет ещё одним звеном в укреплении добрососедских отношений и всестороннего партнерства между Казахстаном и Кыргызстаном.</p>',NULL,NULL,'2025-10-30 09:31:13','2025-10-30 09:31:13');
INSERT INTO `blog_translations` VALUES (72,33,'kk','Қырғызстан делегациясының Алматыдағы «Белсенді ұзақ өмір сүру орталығына» сапары','qyrgyzstan-delegaciiasynyn-almatydagy-belsendi-uzaq-omir-suru-ortalygyna-sapary','<p data-start=\"96\" data-end=\"988\">2025 жылғы қазан айының соңында <strong data-start=\"128\" data-end=\"179\">әл-Фараби атындағы Қазақ ұлттық университетінің</strong> Біліктілікті арттыру және қосымша білім беру институтының қолдауымен Қырғызстаннан келген делегация Алматы қаласындағы <strong data-start=\"299\" data-end=\"339\">&laquo;Белсенді ұзақ өмір сүру орталығына&raquo;</strong> арнайы сапар жасады. Делегация құрамына Қырғыз Республикасы мемлекеттік және қоғамдық ұйымдарының өкілдері кірді. Сапардың басты мақсаты &ndash; екі ел арасындағы тәжірибе алмасу және егде жастағы азаматтардың белсенді өмір сүру мәдениетін дамытудағы заманауи тәсілдермен танысу болды. Қазақстандалық орталықтың жұмысымен танысу барысында қырғызстандық қонақтар аға буынға арналған әлеуметтік қызметтер мен оқыту бағдарламаларына, әсіресе университет базасында іске асырылып жатқан <strong data-start=\"853\" data-end=\"876\">&laquo;Күміс университет&raquo;</strong> жобасына ерекше қызығушылық білдірді.</p>\r\n<p data-start=\"96\" data-end=\"988\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"1044\" data-end=\"3675\">Қазақ және қырғыз тараптары кездесу барысында қарт азаматтардың өмір сүру сапасын арттыру бойынша өзара тәжірибе алмасты. Қазақстан соңғы жылдары белсенді ұзақ өмір сүруді қолдау бағытында ауқымды іс-шаралар атқарып келеді: 2020 жылдан бері елімізде алғашқы белсенді ұзақ өмір сүру орталықтары ашылып, қазіргі уақытта республика бойынша 120 орталық жұмыс істейді (оның 57-сі қалада, 63-і ауылдық жерлерде). 2021 жылы елімізде аға буын азаматтарының жағдайын жақсарту жөніндегі 2025 жылға дейінгі &laquo;Белсенді ұзақ өмір сүру&raquo; іс-шаралар жоспары қабылданған болатын. Алматы қаласында құрылған орталықтар да осы мемлекеттік саясаттың нәтижесі. Делегацияға мегаполистегі орталықтардың бірі &ndash; қалалық <strong data-start=\"1811\" data-end=\"1850\">Белсенді ұзақ өмір сүру орталығының</strong> жұмысы таныстырылды. Бұл орталық егде жастағы адамдарға &laquo;бір терезе&raquo; қағидаты бойынша кешенді қызмет көрсетеді: мұнда белсенді өмір сүру, денсаулық мәдениетін қалыптастыру және қоғаммен байланыс бағыттары бойынша үйірмелер мен шаралар ұйымдастырылған. Қонақтар орталықтағы ардагерлерге арналған түрлі секцияларды өз көздерімен көрді. Атап айтқанда, зейнеткерлер үшін йога, скандинавиялық жүріс, дене шынықтыру гимнастикасы, би және қолөнер сияқты денсаулық пен шығармашылықты қолдау сабақтары, компьютерлік және цифрлық сауаттылықты арттыру курстары, ағылшын тілі мен мотивациялық тренингтер сияқты білім беру бағдарламалары тегін өткізіледі. Сондай-ақ орталықта психологиялық қолдау, құқықтық кеңес беру, медицина мамандарының қабылдауы секілді әлеуметтік қызмет түрлері қарастырылған. Үнемі мәдени және танымдық іс-шаралар (поэзия кештері, концерттер, көрмелер) өткізіліп тұрады. Осындай заманауи жан-жақты тәсіл егде жандардың белсенді өмір сүруіне мотивация беріп, олардың қоғамнан тыс қалмауына ықпал ететіні байқалды. Қырғызстандық делегация орталықтың қызметіне жоғары баға беріп, ұсынылатын қызметтердің ауқымы мен сапасына риза болды. Мұндай орталықтардың жұмысы қарт адамдардың денсаулығын жақсартуға, көңіл күйлерін көтеруге және қоғам өміріне белсене араласуына жағдай жасайтынын қонақтар ерекше атап өтті. Тараптар талқылау барысында Қазақстандағы белсенді ұзақ өмір бағдарламаларының тәжірибесін Қырғызстан жағдайында қолдану мүмкіндіктерін сөз етті. Қырғызстан өкілдері өз елдерінде 2025&ndash;2030 жылдарға арналған &laquo;Белсенді ұзақ өмір сүру&raquo; мемлекеттік бағдарламасы әзірленіп жатқанын айтып, оның аясында Қазақстанның озық тәжірибелері ескерілетініне үміт білдірді.</p>\r\n<h2 data-start=\"3677\" data-end=\"3732\">Оқыту бағдарламалары және &laquo;Күміс университет&raquo; жобасы</h2>\r\n<p data-start=\"3734\" data-end=\"5456\">Сапардың маңызды бөлігінің бірі &ndash; делегацияның еліміздегі аға буынға білім беру бастамаларымен танысуы болды. Алматы қаласында ауқымды әлеуметтік білім беру жобасы &ndash; <strong data-start=\"3900\" data-end=\"3923\">&laquo;Күміс университет&raquo;</strong> табысты жүзеге асуда. Бұл жоба егде тартқан адамдардың қайта білім алып, өз мүмкіндіктерін іске асыруына жол ашатын халықаралық қозғалыстың бір бөлігі болып табылады. Әл-Фараби атындағы ҚазҰУ жанындағы Біліктілікті арттыру институты ұйымдастырған \"Күміс университеті\" жобасы аясында 2024 жылғы сәуір айында Алматыда &laquo;Ұзақ белсенді өмір&raquo; атты арнайы конференция өткізіліп, аға буын өкілдерін оқыту жұмыстары басталған еді. Делегация мүшелері осы жоба аясында жүзеге асырылып жатқан курстардың мазмұны мен ұйымдастырылу тәртібіне айрықша қызығушылық танытты. &laquo;Күміс университет&raquo; тыңдаушыларына өнер, мәдениет, денсаулық, цифрлық технологиялар, тіл үйрену және т.б. салалар бойынша арнайы бағдарламалар қарастырылған. Университеттің тәжірибелі оқытушылары мен еріктілері егде жастағы студенттермен жұмыс істейді. ҚазҰУ басшылығының айтуынша, &laquo;Күміс университет&raquo; жобалары егде жастағы азаматтарды білім, ғылым және шығармашылыққа тартып, олардың әлеуметтік белсенділігі мен өмір сапасын арттыруға септігін тигізеді. Қырғызстандық өкілдер бұл бастаманың қоғам үшін маңыздылығын атап өтіп, өз елінде де сондай &laquo;Үшінші жастағы университет&raquo; үлгісіндегі курстарды енгізу мүмкіндігін қарастыруға қызығушылық білдірді. Екі елдің мамандары аға буынға арналған білім беру әдістемелері мен оқу бағдарламаларын әзірлеу бойынша өзара кеңесіп, осы бағыттағы ықтимал бірлескен жобаларды сөз етті.</p>\r\n<h2 data-start=\"5458\" data-end=\"5509\">Болашақ бірлескен жобалар және кездесудің маңызы</h2>\r\n<p data-start=\"5511\" data-end=\"7077\">Алматыдағы бұл кездесу Қазақстан мен Қырғызстанның әлеуметтік саладағы ынтымақтастығының жаңа белесін айқындады. Тараптар алдағы уақытта бірлескен жобалар мен бастамаларды жүзеге асыруға дайын екендіктерін білдірді. Атап айтқанда, егде жастағы халықпен жұмыс істейтін мамандардың өзара тәжірибе алмасу сапарларын тұрақты негізде ұйымдастыру, екі елде бірдей жүргізуге болатын волонтерлік қозғалыстар құру, &laquo;Белсенді ұзақ өмір&raquo; және &laquo;Күміс университет&raquo; бағыттарында бірлескен зерттеулер мен іс-шаралар өткізу мәселелері талқыланды. Кездесуге қатысушылар бұл бағыттағы өзара ынтымақтастықтың әлеуметтік қана емес, мәдени маңызы зор екеніне тоқталды. Өйткені аға буынға қамқорлық жасау, олардың өмірге құштарлығын қолдау &ndash; қазақ пен қырғыз халқына ортақ құндылық. Осындай кездесулер халықтар арасындағы бауырмалдық байланыстарды нығайтып қана қоймай, қоғамның маңызды саласында ортақ игі нәтижелерге қол жеткізуге мүмкіндік береді. Мысалы, Алматы қаласының &laquo;Әжелер&raquo; тобы халықаралық фестивальдерге қатысып, тіпті Қырғызстанда өткен этнофестивальде жеңіске жеткені мәлім &ndash; бұл да болса белсенді ұзақ өмір бастамаларының жемісті екенінің көрсеткіші. Жалпы алғанда, қырғыз делегациясының сапарын Қазақстан мен Қырғызстан арасындағы ынтымақтастықты кеңейтіп, ортақ платформалар қалыптастыру жолындағы маңызды қадам деп бағалауға болады.&nbsp;Тараптар алдағы уақытта да осы бағытта тығыз байланыста жұмыс істеп, егде жастағы азаматтардың игілігіне арналған жаңа жобаларды бірлесе бастауды көздеп отыр.</p>\r\n<p data-start=\"7093\" data-end=\"8051\">Қырғызстандық делегацияның Алматыдағы Белсенді ұзақ өмір сүру орталығына сапары аясында екі ел мамандары егде жастағы тұрғындардың әл-ауқатын арттыруға бағытталған бастамалар жөнінде жан-жақты пікір алмасты. Қазақстанның белсенді ұзақ өмір сүру орталықтары мен &laquo;Күміс университет&raquo; жобасы қырғызстандық әріптестердің қызығушылығын туғызса, өз кезегінде қазақстандықтар көрші елдегі демографиялық ахуал мен әлеуметтік саясат туралы мағлұмат алды. Кездесу барысында қол жеткізілген өзара түсіністік пен ортақ ниет алдағы уақытта нақты іс-шаралар арқылы жалғасын табатынына сенім мол. Осы сапар нәтижесінде Қазақстан&ndash;Қырғызстан қарым-қатынасының әлеуметтік және мәдени ықпалдастық бағыты жаңа серпін алды деуге болады. Екі елдің егде жастағы азаматтардың лайықты өмір сүру сапасын қамтамасыз ету жолындағы ынтымақтастығы бұдан әрі де дами бермек, бұл өз кезегінде қазақ-қырғыз достығы мен өзара серіктестігін нығайтудың жарқын көріністерінің біріне айналып отыр.</p>',NULL,NULL,'2025-10-30 09:31:13','2025-10-30 09:31:13'),(73,33,'en','Visit of the Kyrgyz Delegation to Almaty’s \"Active Longevity Center\"','visit-of-the-kyrgyz-delegation-to-almatys-active-longevity-center','<p data-start=\"15077\" data-end=\"15878\">On October 29, 2025, with the support of the Institute for Advanced Training and Continuing Education of Al-Farabi Kazakh National University, a delegation from the Kyrgyz Republic paid an official visit to the <strong data-start=\"15288\" data-end=\"15317\">&ldquo;Active Longevity Center&rdquo;</strong> in Almaty. The delegation, comprising representatives of state and public organizations of Kyrgyzstan, came to exchange experience between the two countries and learn about modern approaches to developing a culture of active living among older citizens. During the visit, the Kyrgyz guests showed great interest in the Center&rsquo;s various programs for seniors and in the university-based <strong data-start=\"15742\" data-end=\"15765\">&ldquo;Silver University&rdquo;</strong> project, which offers lifelong learning opportunities for people over 50.</p>\r\n<p data-start=\"15077\" data-end=\"15878\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"15924\" data-end=\"18233\">Kazakhstan&rsquo;s extensive efforts in promoting active longevity formed a key part of the experience exchange. Since the first Active Longevity Center opened in 2020, the country has established a network of such centers (120 centers across Kazakhstan as of 2025) aimed at improving the well-being of the older generation. This initiative is a priority of the national social policy: in 2021, the government adopted an Action Plan on Active Longevity through 2025, and by now Active Longevity Centers operate in both urban and rural areas. In Almaty, the delegation was introduced to the work of one of the city&rsquo;s Active Longevity Centers, which provides a &ldquo;one-stop&rdquo; environment for seniors by offering services in several key areas. The guests observed how the Center organizes a wide range of free activities for elderly visitors &ndash; including wellness exercises like yoga, Nordic walking and therapeutic gymnastics, creative arts and crafts workshops, cultural events, and educational courses (such as computer and digital literacy classes, motivational training, and English language lessons). In addition, the Center provides social support such as medical consultations, psychological counseling, and legal advice for retirees, and regularly holds educational lectures on safety and financial literacy. This modern, holistic approach clearly demonstrates how Kazakhstan motivates older people to maintain an active lifestyle and improves their quality of life. The Kyrgyz delegates were impressed by the breadth and quality of services offered, noting that such measures help seniors stay healthy, improve their mood, and remain engaged in society. During discussions, the two sides explored how Kazakhstan&rsquo;s experience with active longevity programs could be applied in Kyrgyzstan&rsquo;s context. The Kyrgyz representatives shared that their country is developing a State Programme on Active Longevity for 2025&ndash;2030 aimed at enhancing the quality of life of senior citizens, and they expressed hope that Kazakhstan&rsquo;s best practices will inform and inspire their own initiatives.</p>\r\n<h2 data-start=\"18235\" data-end=\"18294\">Educational Programs and the \"Silver University\" Project</h2>\r\n<p data-start=\"18296\" data-end=\"19865\">A highlight of the visit was the focus on educational initiatives for the older generation. The Kazakh hosts introduced the <strong data-start=\"18420\" data-end=\"18443\">&ldquo;Silver University&rdquo;</strong> project &ndash; an international movement that helps retirement-age individuals continue their education and personal development. Launched at KazNU in the spring of 2024, this project opens new opportunities for people over 50: they can upgrade their skills, learn a new profession, or acquire knowledge in fields of interest. The delegation learned that as part of the Silver University program, seniors can enroll in courses on a wide variety of subjects &ndash; from basic computer literacy and foreign languages to arts, healthy lifestyle practices, and even volunteering. According to KazNU representatives, the goal of &ldquo;Silver University&rdquo; is to support learning after the age of 50, improve the quality of life for older people, and set a positive example for the younger generation. The Kyrgyz guests showed great enthusiasm for this model of lifelong education. They were particularly interested in how the training for retirees is organized: from recruiting senior learners and developing tailored curricula to engaging qualified instructors and volunteers. The parties discussed the possibility of introducing similar &ldquo;university of the third age&rdquo; courses in Kyrgyzstan to empower its elderly citizens to engage in education, science, and creativity, thereby increasing their social activity and vitality.</p>\r\n<h2 data-start=\"19867\" data-end=\"19926\">Future Joint Initiatives and Significance of the Meeting</h2>\r\n<p data-start=\"19928\" data-end=\"21197\">The visit also served as a platform to discuss prospects for future joint projects and strengthened cooperation. Representatives of both countries affirmed their intent to expand partnership in promoting active aging and supporting the elderly. In particular, they considered organizing reciprocal visits of specialists working with senior citizens, conducting joint workshops and trainings, and exchanging experts to continue sharing best practices. Both sides emphasized the social and cultural significance of such initiatives: these exchanges not only foster friendship between the peoples, but also advance a shared humanitarian dimension of bilateral relations. The meeting in Almaty demonstrated that Kazakhstan and Kyrgyzstan share common values in respecting the older generation and are eager to jointly seek innovative approaches to demographic challenges. Thus, this visit became an important step toward bolstering cooperation between the two countries and creating a new platform for experience exchange in the realm of active longevity. The parties agreed to maintain an ongoing dialogue and to develop concrete collaborative projects and initiatives for the benefit of senior citizens in Kazakhstan and Kyrgyzstan.</p>\r\n<p data-start=\"21214\" data-end=\"22017\">Overall, the Kyrgyz delegation&rsquo;s visit to Almaty&rsquo;s Active Longevity Center &ndash; facilitated by KazNU &ndash; was productive and successful. It enabled a practical exchange of knowledge and best practices in supporting older adults: the Kyrgyz colleagues learned about Kazakhstan&rsquo;s cutting-edge efforts in this field, while Kazakh specialists gained insights into the approaches of a neighboring country. Such meetings greatly broaden the scope of Kazakhstan&ndash;Kyrgyzstan cooperation, adding new substance to it in the socio-cultural sphere. The mutual commitment to caring for the older generation brings our nations closer together, and joint work on active longevity projects will become another link in strengthening the good-neighborly relations and comprehensive partnership between Kazakhstan and Kyrgyzstan.</p>',NULL,NULL,'2025-10-30 09:31:13','2025-10-30 09:31:13'),(74,34,'ru','Открытый урок на тему «Белки — основа живых организмов»','otkrytyi-urok-na-temu-belki-osnova-zivyx-organizmov','<p data-start=\"1425\" data-end=\"1687\">На кафедре биологии состоялся открытый урок на тему <strong data-start=\"1477\" data-end=\"1514\">&laquo;Белки &mdash; основа живых организмов&raquo;</strong>, который провела <strong data-start=\"1532\" data-end=\"1560\">профессор М. Р. Баратова</strong>. Занятие было посвящено изучению структуры, классификации и биологической роли белков как ключевых соединений живой материи.</p>\r\n<p data-start=\"1425\" data-end=\"1687\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"1689\" data-end=\"1881\">В теоретической части студенты познакомились с <strong data-start=\"1736\" data-end=\"1878\">элементарным составом белков, процессом денатурации, классификацией протеинов и различием между простыми и сложными белковыми соединениями</strong>.</p>\r\n<p data-start=\"1883\" data-end=\"2171\">Практическая часть урока прошла в лабораторной форме. Слушатели самостоятельно проводили <strong data-start=\"1972\" data-end=\"2018\">эксперименты по определению свойств белков</strong>, работали с реактивами и микропробирками, осваивая методы биохимического анализа. Особое внимание уделялось точности и соблюдению правил безопасности.</p>\r\n<p data-start=\"1883\" data-end=\"2171\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"2173\" data-end=\"2409\">Профессор Баратова подчеркнула, что подобные занятия способствуют развитию научного мышления и формированию практических навыков исследователя, что особенно важно для будущих специалистов биологического и агротехнологического профиля.</p>\r\n<p data-start=\"2411\" data-end=\"2544\">Завершилось занятие обсуждением итогов лабораторных опытов и осмыслением <strong data-start=\"2484\" data-end=\"2541\">значения белков для функционирования живых организмов</strong>.</p>',NULL,NULL,'2025-10-30 12:55:36','2025-10-30 12:55:36'),(75,34,'kk','«Белоктар – тірі ағзалардың негізі» тақырыбындағы ашық сабақ','beloktar-tiri-agzalardyn-negizi-taqyrybyndagy-asyq-sabaq','<p data-start=\"221\" data-end=\"454\">Биология кафедрасында &laquo;<strong data-start=\"244\" data-end=\"281\">Белоктар &ndash; тірі ағзалардың негізі</strong>&raquo; тақырыбында ашық сабақ өтті. Сабақты <strong data-start=\"320\" data-end=\"348\">профессор М. Р. Баратова</strong> жүргізіп, тыңдаушыларға белоктардың құрылысы мен биологиялық маңызы жөнінде терең ғылыми түсінік берді.</p>\r\n<p data-start=\"456\" data-end=\"642\">Сабақ барысында студенттер <strong data-start=\"483\" data-end=\"601\">белоктардың элементтік құрамы, денатурация үдерісі, жіктелуі, қарапайым және күрделі протеиндердің айырмашылықтары</strong> сияқты теориялық ұғымдарды қарастырды.</p>\r\n<p data-start=\"456\" data-end=\"642\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"644\" data-end=\"874\">Практикалық бөлімде тыңдаушылар зертханалық жағдайда тәжірибелер орындап, <strong data-start=\"718\" data-end=\"753\">белоктардың қасиеттерін анықтау</strong> бойынша эксперимент жүргізді. Зерттеу барысында қауіпсіздік ережелері мен ғылыми дәлдікті сақтау ерекше назарда болды.</p>\r\n<p data-start=\"644\" data-end=\"874\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"876\" data-end=\"1075\">Профессор Баратова мұндай сабақтардың студенттердің теориялық білімін тереңдетіп қана қоймай, ғылыми зерттеу дағдыларын қалыптастыратынын және биохимияға деген қызығушылықты арттыратынын атап өтті.</p>\r\n<p data-start=\"1077\" data-end=\"1328\">Сабақ соңында қатысушылар алынған нәтижелерді талқылап, <strong data-start=\"1133\" data-end=\"1170\">белоктардың тіршілік үшін маңызын</strong> қорытындылады. Ашық сабақ студенттердің белсенді қатысуымен өтіп, биология және агротехнология салаларындағы болашақ мамандардың кәсіби дамуына үлес қосты.</p>',NULL,NULL,'2025-10-30 12:55:36','2025-10-30 12:55:36');
INSERT INTO `blog_translations` VALUES (76,34,'en','Open Lesson on “Proteins – The Basis of Living Organisms”','open-lesson-on-proteins-the-basis-of-living-organisms','<p data-start=\"86\" data-end=\"403\">An open lesson on the topic <strong data-start=\"114\" data-end=\"160\">&ldquo;Proteins &ndash; The Basis of Living Organisms&rdquo;</strong> was held at the Department of Biology, led by <strong data-start=\"207\" data-end=\"235\">Professor M. R. Baratova</strong>. The session was devoted to exploring the structure, classification, and biological importance of proteins &mdash; essential macromolecules that sustain all forms of life.</p>\r\n<p data-start=\"405\" data-end=\"630\">During the theoretical part of the lesson, students examined the <strong data-start=\"470\" data-end=\"627\">elementary composition of proteins, the process of denaturation, protein classification, and the differences between simple and complex protein compounds</strong>.</p>\r\n<p data-start=\"405\" data-end=\"630\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"632\" data-end=\"915\">The practical section took place in a laboratory setting, where participants conducted <strong data-start=\"719\" data-end=\"765\">experiments to identify protein properties</strong>. They worked with reagents, petri dishes, and laboratory tools, applying biochemical methods and observing safety standards throughout the process.</p>\r\n<p data-start=\"632\" data-end=\"915\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"917\" data-end=\"1170\">Professor Baratova emphasized that such interactive sessions not only deepen theoretical understanding but also foster <strong data-start=\"1036\" data-end=\"1091\">scientific thinking, precision, and research skills</strong> &mdash; all crucial for future specialists in biology and agricultural technology.</p>\r\n<p data-start=\"1172\" data-end=\"1513\">At the conclusion of the open lesson, students discussed their experimental results and reflected on the <strong data-start=\"1277\" data-end=\"1333\">vital role of proteins in maintaining life processes</strong>. The event highlighted the importance of combining theory and practice in scientific education, inspiring students to pursue further research in biochemistry and related fields.</p>',NULL,NULL,'2025-10-30 12:55:36','2025-10-30 12:55:36'),(77,35,'ru','Проходят курсы по финансовой и правовой грамотности','proxodiat-kursy-po-finansovoi-i-pravovoi-gramotnosti','<p data-start=\"123\" data-end=\"465\">В Институте повышения квалификации и дополнительного образования Казахского национального университета имени аль-Фараби проходят <strong data-start=\"252\" data-end=\"298\">курсы по финансовой и правовой грамотности</strong>.<br data-start=\"299\" data-end=\"302\">Программа направлена на развитие у слушателей практических знаний, необходимых для уверенного ориентирования в современном экономическом и правовом пространстве.</p>\r\n<p data-start=\"467\" data-end=\"495\">В ходе обучения участники:</p>\r\n<ul data-start=\"496\" data-end=\"748\">\r\n<li data-start=\"496\" data-end=\"561\">\r\n<p data-start=\"498\" data-end=\"561\"><strong>осваивают принципы эффективного управления личными финансами;</strong></p>\r\n</li>\r\n<li style=\"font-weight: bold;\" data-start=\"562\" data-end=\"621\">\r\n<p data-start=\"564\" data-end=\"621\"><strong>изучают основы налогового и трудового законодательства;</strong></p>\r\n</li>\r\n<li style=\"font-weight: bold;\" data-start=\"622\" data-end=\"678\">\r\n<p data-start=\"624\" data-end=\"678\"><strong>знакомятся с инструментами защиты прав потребителей;</strong></p>\r\n</li>\r\n<li style=\"font-weight: bold;\" data-start=\"679\" data-end=\"748\">\r\n<p data-start=\"681\" data-end=\"748\"><strong>анализируют современные экономические тенденции и цифровые риски.</strong></p>\r\n</li>\r\n</ul>\r\n<p data-start=\"750\" data-end=\"996\">Занятия проводят опытные преподаватели и специалисты-практики, которые делятся реальными примерами и полезными кейсами. Особое внимание уделяется вопросам финансовой безопасности, предотвращению мошенничества и правовой защите в цифровой среде.</p>\r\n<p data-start=\"998\" data-end=\"1156\">Курс организован в офлайн и онлайн форматах, что позволяет каждому слушателю выбрать удобный способ обучения.<br data-start=\"1107\" data-end=\"1110\"><br></p>',NULL,NULL,'2025-10-31 09:11:23','2025-10-31 09:11:23'),(78,35,'kk','Қаржылық және құқықтық сауаттылық курстары өтіп жатыр','qarzylyq-zane-quqyqtyq-sauattylyq-kurstary-otip-zatyr','<p data-start=\"126\" data-end=\"524\">Әл-Фараби атындағы Қазақ ұлттық университетінің <strong data-start=\"174\" data-end=\"235\">Біліктілікті арттыру және қосымша білім беру институтында</strong> тыңдаушыларға арналған <strong data-start=\"259\" data-end=\"296\">қаржылық және құқықтық сауаттылық</strong> курстары басталып, сәтті жалғасуда. Бағдарламаның басты мақсаты &ndash; тыңдаушылардың экономикалық және құқықтық мәдениетін арттыру, сонымен қатар заманауи қоғам жағдайында өз құқықтары мен қаржысын сауатты басқаруға мүмкіндік беру.</p>\r\n<p data-start=\"526\" data-end=\"553\">Курс барысында қатысушылар:</p>\r\n<ul data-start=\"554\" data-end=\"838\">\r\n<li data-start=\"554\" data-end=\"618\">\r\n<p data-start=\"556\" data-end=\"618\"><strong data-start=\"580\" data-end=\"617\">құқықтық нормаларды дұрыс қолдану</strong>;</p>\r\n</li>\r\n<li data-start=\"619\" data-end=\"672\">\r\n<p data-start=\"621\" data-end=\"672\"><strong data-start=\"621\" data-end=\"671\">қаржы ресурстарын тиімді жоспарлау мен басқару</strong>;</p>\r\n</li>\r\n<li data-start=\"673\" data-end=\"737\">\r\n<p data-start=\"675\" data-end=\"737\"><strong data-start=\"675\" data-end=\"736\">құқықтық құжаттармен және нормативтік базамен жұмыс жасау</strong>;</p>\r\n</li>\r\n<li data-start=\"738\" data-end=\"838\">\r\n<p data-start=\"740\" data-end=\"838\"><strong data-start=\"740\" data-end=\"795\">заманауи экономикалық үрдістерді талдау және түсіну</strong> сияқты бағыттарда тәжірибелік білім алуда.</p>\r\n</li>\r\n</ul>\r\n<p data-start=\"840\" data-end=\"1086\">Сабақтар тәжірибелі заңгерлер мен экономист мамандардың қатысуымен өткізіліп, нақты мысалдар мен өмірлік жағдайлар негізінде түсіндіріледі. Бұл тәсіл тыңдаушыларға теориялық біліммен қатар практикалық дағдыны да қалыптастыруға мүмкіндік береді.</p>\r\n<p data-start=\"1088\" data-end=\"1481\">Курс барысында қатысушылар <strong data-start=\"1115\" data-end=\"1139\">қаржылық қауіпсіздік</strong>, <strong data-start=\"1141\" data-end=\"1167\">жеке деректерді қорғау</strong>, <strong data-start=\"1169\" data-end=\"1196\">инвестициялау негіздері</strong>, сондай-ақ <strong data-start=\"1208\" data-end=\"1259\">азаматтық-құқықтық қатынастардағы жауапкершілік</strong> мәселелері бойынша өзекті ақпаратпен танысады. Сонымен қатар, цифрлық экономика жағдайында жеке тұлғаның құқықтық қорғалуы және қаржылық шешім қабылдау кезінде туындайтын тәуекелдерді төмендету жолдары да қарастырылады.</p>\r\n<p data-start=\"1483\" data-end=\"1760\"><strong data-start=\"1483\" data-end=\"1517\">Біліктілікті арттыру институты</strong> осындай курстар арқылы заманауи кәсіби және әлеуметтік ортада азаматтардың сауатты, жауапты әрі қауіпсіз әрекет етуіне ықпал етуді мақсат етеді. Курстар офлайн және онлайн форматтарда ұйымдастырылып, тыңдаушылардың ыңғайына қарай бейімделген.</p>',NULL,NULL,'2025-10-31 09:11:23','2025-10-31 09:11:23'),(79,35,'en','Financial and Legal Literacy Courses Are Underway','financial-and-legal-literacy-courses-are-underway','<p data-start=\"1226\" data-end=\"1588\">The Institute for Advanced Training and Continuing Education at Al-Farabi Kazakh National University has launched <strong data-start=\"1340\" data-end=\"1380\">financial and legal literacy courses</strong> for professionals and the general public.<br data-start=\"1422\" data-end=\"1425\">The program aims to enhance participants&rsquo; understanding of modern economic processes and strengthen their ability to make informed financial and legal decisions.</p>\r\n<p data-start=\"1590\" data-end=\"1626\">During the training, participants:</p>\r\n<ul data-start=\"1627\" data-end=\"1902\">\r\n<li data-start=\"1627\" data-end=\"1698\">\r\n<p data-start=\"1629\" data-end=\"1698\"><strong>learn how to effectively manage personal and professional finances;</strong></p>\r\n</li>\r\n<li style=\"font-weight: bold;\" data-start=\"1699\" data-end=\"1758\">\r\n<p data-start=\"1701\" data-end=\"1758\"><strong>study the fundamentals of tax, labor, and consumer law;</strong></p>\r\n</li>\r\n<li style=\"font-weight: bold;\" data-start=\"1759\" data-end=\"1823\">\r\n<p data-start=\"1761\" data-end=\"1823\"><strong>explore ways to ensure financial safety and data protection;</strong></p>\r\n</li>\r\n<li style=\"font-weight: bold;\" data-start=\"1824\" data-end=\"1902\">\r\n<p data-start=\"1826\" data-end=\"1902\"><strong>discuss real-world cases related to modern financial and legal challenges.</strong></p>\r\n</li>\r\n</ul>\r\n<p data-start=\"1904\" data-end=\"2143\">Courses are led by experienced lecturers and field experts who focus on practical examples and applicable knowledge. A special emphasis is placed on financial awareness, preventing online fraud, and understanding digital-era legislation.</p>\r\n<p data-start=\"2145\" data-end=\"2305\">&nbsp;</p>',NULL,NULL,'2025-10-31 09:11:23','2025-10-31 09:11:23'),(80,36,'ru','Начались курсы по педагогике','nacalis-kursy-po-pedagogike','<p data-start=\"1404\" data-end=\"1736\">В Институте повышения квалификации и дополнительного образования Казахского национального университета имени аль-Фараби стартовали <strong data-start=\"1535\" data-end=\"1575\">курсы по педагогическому направлению</strong>.<br data-start=\"1576\" data-end=\"1579\">Программа направлена на совершенствование профессиональных компетенций преподавателей и внедрение инновационных методов обучения в образовательный процесс.</p>\r\n<p data-start=\"1404\" data-end=\"1736\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"1738\" data-end=\"2087\">Первыми слушателями стали преподаватели <strong data-start=\"1778\" data-end=\"1857\">Нукусского государственного педагогического института имени Ажинияза (НГПИ)</strong> и <strong data-start=\"1860\" data-end=\"1891\">Университета имени Шакарима</strong>. В ходе занятий участники осваивают современные методики преподавания, а также получают практические навыки по использованию цифровых инструментов и интерактивных технологий в учебном процессе.</p>\r\n<p data-start=\"2089\" data-end=\"2131\">В рамках программы рассматриваются темы:</p>\r\n<ul data-start=\"2132\" data-end=\"2386\">\r\n<li data-start=\"2132\" data-end=\"2196\">\r\n<p data-start=\"2134\" data-end=\"2196\">современные педагогические инновации и методические подходы;</p>\r\n</li>\r\n<li data-start=\"2197\" data-end=\"2255\">\r\n<p data-start=\"2199\" data-end=\"2255\">развитие креативного и критического мышления учащихся;</p>\r\n</li>\r\n<li data-start=\"2256\" data-end=\"2324\">\r\n<p data-start=\"2258\" data-end=\"2324\">применение цифровых технологий и интерактивных методов обучения;</p>\r\n</li>\r\n<li data-start=\"2325\" data-end=\"2386\">\r\n<p data-start=\"2327\" data-end=\"2386\">оценка качества образования и эффективная обратная связь.</p>\r\n</li>\r\n</ul>\r\n<p data-start=\"2388\" data-end=\"2555\">Курсы проводятся в офлайн и онлайн форматах под руководством опытных преподавателей и экспертов. Такая форма обучения обеспечивает гибкость и комфорт для слушателей.</p>',NULL,NULL,'2025-10-31 10:40:34','2025-10-31 10:40:34'),(81,36,'kk','Педагогика бағыты бойынша курстар басталды','pedagogika-bagyty-boiynsa-kurstar-bastaldy','<p data-start=\"147\" data-end=\"414\">Әл-Фараби атындағы Қазақ ұлттық университетінің <strong data-start=\"195\" data-end=\"256\">Біліктілікті арттыру және қосымша білім беру институтында</strong> педагогика бағыты бойынша курстар өз бастауын алды. Бұл бағдарлама заманауи педагогикалық әдістемелерді меңгеріп, білім беру сапасын арттыруға бағытталған.</p>\r\n<p data-start=\"147\" data-end=\"414\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"416\" data-end=\"744\">Курстың алғашқы тыңдаушылары қатарында <strong data-start=\"455\" data-end=\"527\">Ажинияз атындағы Нөкіс мемлекеттік педагогикалық институтының (НГПИ)</strong> және <strong data-start=\"533\" data-end=\"560\">Шәкәрім университетінің</strong> профессор-оқытушылары бар. Олар заманауи білім беру үрдісін жетілдіру, инновациялық технологияларды тиімді енгізу және оқыту сапасын жақсарту бойынша терең білім мен тәжірибе алуда.</p>\r\n<p data-start=\"746\" data-end=\"820\">Бағдарлама аясында педагогтар келесі бағыттар бойынша дайындықтан өтеді:</p>\r\n<ul data-start=\"821\" data-end=\"1100\">\r\n<li data-start=\"821\" data-end=\"904\">\r\n<p data-start=\"823\" data-end=\"904\">қазіргі білім беру жүйесіндегі педагогикалық инновациялар мен заманауи әдістер;</p>\r\n</li>\r\n<li data-start=\"905\" data-end=\"970\">\r\n<p data-start=\"907\" data-end=\"970\">білім алушылардың креативті және сыни ойлау қабілетін дамыту;</p>\r\n</li>\r\n<li data-start=\"971\" data-end=\"1035\">\r\n<p data-start=\"973\" data-end=\"1035\">цифрлық құралдар мен интерактивті әдістерді сабақта қолдану;</p>\r\n</li>\r\n<li data-start=\"1036\" data-end=\"1100\">\r\n<p data-start=\"1038\" data-end=\"1100\">білім беру сапасын бағалау және тиімді кері байланыс орнату.</p>\r\n</li>\r\n</ul>\r\n<p data-start=\"1102\" data-end=\"1319\">Курстар тәжірибелі мамандардың жетекшілігімен өткізіліп, практикалық тапсырмалар мен тренингтер арқылы жүзеге асуда.<br data-start=\"1218\" data-end=\"1221\">Оқыту офлайн және онлайн форматтарда ұйымдастырылған, бұл тыңдаушыларға ыңғайлы жағдай туғызады.</p>',NULL,NULL,'2025-10-31 10:40:34','2025-10-31 10:40:34'),(82,36,'en','Pedagogy Courses Have Begun','pedagogy-courses-have-begun','<p data-start=\"2651\" data-end=\"2868\">The <strong data-start=\"2655\" data-end=\"2715\">Institute for Advanced Training and Continuing Education</strong> at Al-Farabi Kazakh National University has launched <strong data-start=\"2769\" data-end=\"2789\">pedagogy courses</strong> aimed at enhancing teaching quality and professional skills among educators.</p>\r\n<p data-start=\"2651\" data-end=\"2868\"><img src=\"data:image/jpeg;base64,\"></p>\r\n<p data-start=\"2870\" data-end=\"3191\">The first participants include faculty members from <strong data-start=\"2922\" data-end=\"2975\">Ajiniyaz Nukus State Pedagogical Institute (NGPI)</strong> and <strong data-start=\"2980\" data-end=\"3003\">Shakarim University</strong>. Throughout the program, they are gaining practical experience in modern teaching methodologies, educational innovations, and the integration of digital tools into the learning process.</p>\r\n<p data-start=\"3193\" data-end=\"3242\">The course curriculum covers key areas such as:</p>\r\n<ul data-start=\"3243\" data-end=\"3505\">\r\n<li data-start=\"3243\" data-end=\"3303\">\r\n<p data-start=\"3245\" data-end=\"3303\">modern pedagogical innovations and instructional design;</p>\r\n</li>\r\n<li data-start=\"3304\" data-end=\"3366\">\r\n<p data-start=\"3306\" data-end=\"3366\">development of creative and critical thinking in students;</p>\r\n</li>\r\n<li data-start=\"3367\" data-end=\"3442\">\r\n<p data-start=\"3369\" data-end=\"3442\">effective use of digital technologies and interactive teaching methods;</p>\r\n</li>\r\n<li data-start=\"3443\" data-end=\"3505\">\r\n<p data-start=\"3445\" data-end=\"3505\">assessment of educational quality and feedback strategies.</p>\r\n</li>\r\n</ul>\r\n<p data-start=\"3507\" data-end=\"3660\">Training sessions are conducted by experienced experts in both offline and online formats, ensuring flexibility and accessibility for all participants.</p>',NULL,NULL,'2025-10-31 10:40:34','2025-10-31 10:40:34');
