INSERT INTO `testimonial_translations` VALUES (4,3,'ru','\"Курсы были очень полезными. Я изучил новые методы, и результаты моих учеников улучшились. Очень ценный опыт для учителей!\"','Айгуль Нурланова','Школьный учитель','2025-09-03 11:57:44','2025-09-03 11:57:44'),(5,3,'kk','\"Курстар өте пайдалы болды. Жаңа әдістерді үйрендім және оқушыларымның нәтижелері жақсарды. Мұғалімдер үшін өте құнды тәжірибе!\"','Айгүл Нұрланова','Мектеп мұғалімі','2025-09-03 11:57:44','2025-09-03 11:57:44'),(6,3,'en','\"The courses were very useful. I\'ve learned new methods, and my students\' results have improved. A very valuable experience for teachers!\"','Aigul Nurlanova','The school teacher','2025-09-03 11:57:44','2025-09-03 11:57:44'),(8,4,'ru','Превосходные курсы! Материал изложен очень доступно и понятно. Получил много новых знаний и навыков.','Дмитрий Козлов','Преподаватель физики','2025-09-03 12:01:08','2025-09-03 12:01:08'),(9,4,'kk','Керемет курстар! Материал өте қолжетімді және түсінікті түрде берілген. Көптеген жаңа білімдер мен дағдылар алдым.','Дмитрий Козлов','Физика мұғалімі','2025-09-03 12:01:08','2025-09-03 12:01:08'),(10,4,'en','Excellent courses! The material is presented very clearly and understandably. I gained a lot of new knowledge and skills.','Dmitry Kozlov','Physics Teacher','2025-09-03 12:01:08','2025-09-03 12:01:08'),(11,5,'ru','Очень качественные курсы! Инструкторы профессиональные, материал актуальный. Рекомендую для повышения квалификации.','Елена Смирнова','Учитель английского языка','2025-09-03 12:01:17','2025-09-03 12:01:17'),(12,5,'kk','Өте сапалы курстар! Нұсқаушылар кәсіби, материал өзекті. Біліктілікті арттыру үшін ұсынып отырмын.','Елена Смирнова','Ағылшын тілі мұғалімі','2025-09-03 12:01:17','2025-09-03 12:01:17'),(13,5,'en','Very high quality courses! The instructors are professional, the material is relevant. I recommend for professional development.','Elena Smirnova','English Teacher','2025-09-03 12:01:17','2025-09-03 12:01:17');
